(1, 'PORTFOLIO000001', 2, 10, 'diwr4986', '2TFrK6RMeoGIPESpOJbW', 1, 1, 'Develop Inspire Website', 'DIW (Develop Inspire Website) adalah sebuah jasa pembuatan website dengan teknik PHP dan database mysql yang menghubungkan anda dengan situs website. Kami membantu anda pada usaha atau company profile yang anda buat untuk terhubung secara online. Kebanyakan sekarang ini, para masyarakat sudah menggunakan komputer, laptop, maupun smartphone. Tentu hal ini memudahkan para masyarakat mengetahui usaha atau profile anda secara mudah dan di akses oleh seluruh pengguna, mulai dari kota anda, negara anda(indonesia), bahkan di internasional! Tentu kami menawarkan harga dan fitur beda dari yang lain. Harga yang kami tawarkan tidak murah, kenapa? Karena kami mengkoding dari awal dengan memakai PHP code dan perpaduan SQL Database. Kemudian untuk fitur, kami menggunakan hosting dan domain yang ternama. White SEO, Database Produk Anda, dan kami tetap memfollow anda.', '//www.developinspirewebsite.com', 0, 'logo-develop-inspire-website.webp', 'develop-inspire-website-1.webp', 'develop-inspire-website-2.webp', 'develop-inspire-website-3.webp', 'develop-inspire-website-4.webp', 'develop-inspire-website-5.webp', NULL, NULL, '2022-06-17', '2015-10-27 00:00:00', NULL, 1, 'develop-inspire-website', '2015-10-26 03:00:00', '2022-04-29 13:41:22', NULL),
(2, 'PORTFOLIO000002', 4, 11, 'andrisun', 'j-qIZ2.H4kd65F', 1, 1, 'Andri Sunardi', 'Hi. My Name is Andri Sunardi. I Work at DIW.co.id (Develop Inspire Website) as a Founder and CEO. I became freelancer to create website for client with their requirements. My passion is a code and learn about information technology.', '//www.andrisunardi.com', 0, 'logo-andri-sunardi.webp', 'andri-sunardi-1.webp', 'andri-sunardi-2.webp', 'andri-sunardi-3.webp', 'andri-sunardi-4.webp', 'andri-sunardi-5.webp', NULL, NULL, '2022-06-17', '2015-11-12 00:00:00', 'Rumah Webande2795Andrisunardi25!', 1, 'andri-sunardi', '2015-11-11 03:00:00', '2022-04-29 13:41:29', NULL),
(3, 'PORTFOLIO000003', 5, 11, '', '', 1, 1, 'Forum Universitas Buddhi Dharma', 'Forum Universitas Buddhi Dharma \nadalah komunitas jaringan online untuk berdikusi maupun pembelajaran online pada Universitas Buddhi Dharma.', '', 0, 'logo-forum-universitas-buddhi-dharma.webp', 'forum-universitas-buddhi-dharma-1.webp', 'forum-universitas-buddhi-dharma-2.webp', 'forum-universitas-buddhi-dharma-3.webp', 'forum-universitas-buddhi-dharma-4.webp', 'forum-universitas-buddhi-dharma-5.webp', '', '', NULL, '2015-04-10 07:00:00', '', 1, 'forum-universitas-buddhi-dharma', '2015-04-09 03:00:00', '2020-11-07 15:03:42', NULL),
(4, 'PORTFOLIO000004', 6, 28, 'aflash_game', 'game2014!$', 1, 1, 'AFlashGame', 'AFlashGame adalah Website Gratis (Free To Play) dan di kelola secara professional oleh Manajemen AFlashGame dengan di bantu oleh Admin dan Staff kami. Web AFlashGame adalah milik bersama, untuk itu peran serta kalian untuk menjaga kelangsungan Web AFlashGame sangat kami hargai.', 'http://www.aflashgame.com', 0, 'logo-aflashgame.webp', 'aflashgame-1.webp', 'aflashgame-2.webp', 'aflashgame-3.webp', 'aflashgame-4.webp', 'aflashgame-5.webp', 'Walau masih muda dan statusnya masih duduk di bangku kuliah, \nAndri Sunardi merupakan pemuda yang memiliki keinginan besar dalam mengembangkan usahanya.\n\nJasa pembuatan web yang dijalankannya ini sangatlah memuaskan. Dari desian yang menarik hingga sistem managemen website yang disediakan \nmembuat user lebih mudah dalam melakukan pembaruan pada situs webnya.\n\nDan bagi yang ingin memiliki usaha seperti eCommerce atau sekedar memperkenalkan perusahaannya di internet, disinilah tempatnya.\n\nBy William Tansil\nCEO Mygies Interactive\nThe First Winner of Reality Bytes Contest, Mochimedia, San Fransisco', '', '2014-12-04', '2013-12-04 07:00:00', '', 1, 'aflashgame', '2013-12-03 03:00:00', '2020-11-07 15:03:42', NULL),
(5, 'PORTFOLIO000005', 11, 2, 'plati410', '9o90xG6vJe', 1, 1, 'Platinum Notebook', 'Specialist in sales, accessories, service notebook, spare part & repair\nJual: Adaptor, Keyboard, Battery, LCD, HDD, DVD Combo, DVD RW, Memory\n\nHEAD OFFICE\n\nPlatinum Notebook\nHarco Mangga Dua Lt.1 Hall Tengah C No. M 23\nJl. Mangga Dua Raya, Jakarta Pusat 10730 \nFax: 021 623 07 398\nTel: 021 623 07 833\nTel: 93 178 829\nTel: 0818 885 629\nBBM: 25AD7CBE\nE-mail: platinumnotebook@yahoo.co.id', 'http://www.platinumnotebook.com', 500000, 'logo-platinum-notebook.webp', 'platinum-notebook-1.webp', 'platinum-notebook-2.webp', 'platinum-notebook-3.webp', 'platinum-notebook-4.webp', 'platinum-notebook-5.webp', 'Mohon maaf andri, saya baru sempat memberikan testimoni nya.\nSaya tahu jasa website andri dari anak teman saya, Tommy Septiandy.\nUntuk design cukup simple dan tidak ribet.\nDan juga semua dagangan dapat di lihat secara oniine.', '', '2015-07-10', '2014-06-16 07:00:00', '', 1, 'platinum-notebook', '2014-06-15 03:00:00', '2020-11-07 15:03:42', NULL),
(6, 'PORTFOLIO000006', 2, 1, '', '', 1, 1, 'PT Giga Kontruksi', 'PT. GIGA KONSTRUKSI didirikan dengan tujuan melakukan usaha yang bergerak di bidang pembangunan  properti dengan fokus pembangunan Properti Komersial dan Residensial.\n\nPerkembangan Kota Tangerang yang diproyeksikan sebagai daerah yang dapat menggerakkan berbagai aktifitas penghidupan dan kehidupan dari aspek sosial, ekonomi, budaya dan politik.\n\nLetak kawasan yang strategis sebagai penyangga Ibukota DKI Jakarta.', '', 200000, 'logo-pt-giga-kontruksi.webp', 'pt-giga-kontruksi-1.webp', 'pt-giga-kontruksi-2.webp', 'pt-giga-kontruksi-3.webp', 'pt-giga-kontruksi-4.webp', 'pt-giga-kontruksi-5.webp', 'Untuk teman saya Andri Sunardi, terima kasih telah membuatkan saya website,\nDan juga thank you juga sudah memberikan diskon ke saya haha...\n\nPokoknya mantap dah bro.\nSukses selalu dan makin berkembang lagi jasa websitenya.', '', NULL, '2014-04-04 07:00:00', '', 1, 'pt-giga-kontruksi', '2014-04-03 03:00:00', '2020-11-07 15:03:42', NULL),
(7, 'PORTFOLIO000007', 4, 3, '', '', 1, 1, 'Alex Hardikoesoemo', 'MMM Mavrodi Indonesia adalah komunitas dimana semua anggotanya saling membantu yang dilengkapi dengan sistem Provide Help dan Get Help.\nSudah ribuan orang menjadi member kami, ayo bergabung bersama kami, komunitas paling oke, segera daftar, dan bergabung dengan kami.', 'http://www.hardikoesoemo.com', 1000000, 'logo-alex-hardikoesoemo.webp', 'alex-hardikoesoemo-1.webp', 'alex-hardikoesoemo-2.webp', 'alex-hardikoesoemo-3.webp', 'alex-hardikoesoemo-4.webp', 'alex-hardikoesoemo-5.webp', 'Dengan adanya website, saya menjadi banyak follower dan tambah terkenal. DIW membuat saya menjadi banyak pengikut dan mengetahui tentang jasa yang saya buat. Terima kasih DIW.', '', '2016-02-18', '2015-02-14 07:00:00', '', 1, 'alex-hardikoesoemo', '2015-02-13 03:00:00', '2020-11-07 15:03:42', NULL),
(8, 'PORTFOLIO000008', 2, 5, 'cvsdj422', 'Diw.co.id2015!', 1, 1, 'CV Star Delta Jaya Abadi', 'CV Star Delta Jaya Abadi adalah salah satu perusahaan yang bergerak di bidang subkontraktor, Mekanilak Elektrikal (ME).\r\nTim pekerjaan kami adalah tenaga ahli dan terlatih di bidang masing-masing pekerjaan, yaitu:\r\n\r\n1. Instalasi listrik dan semua sistem arus kuat.\r\n2. Instalasi arus lemah, sistem fire alarm, sistem telfon, sistem data wireless, sistem sound.\r\n3. Instalasi pemadam kebakaran dan sistem setting pompa HYDRANT SPLINKLER.\r\n4. Instalasi pipa2 AC dan sistem seting indoor outdoor Ac, AHU, FCU, CILER.\r\n5. Instalasi Ducting BJLS, DUCTING FIU.', 'http://www.cvsdja.com', 1300000, 'logo-cv-star-delta-jaya-abadi.webp', 'cv-star-delta-jaya-abadi-1.webp', 'cv-star-delta-jaya-abadi-2.webp', 'cv-star-delta-jaya-abadi-3.webp', 'cv-star-delta-jaya-abadi-4.webp', 'cv-star-delta-jaya-abadi-5.webp', NULL, NULL, '2019-10-29', '2015-08-20 07:00:00', NULL, 1, 'cv-star-delta-jaya-abadi', '2015-08-19 03:00:00', '2021-03-16 16:34:05', NULL),
(9, 'PORTFOLIO000009', 2, 6, 's3cz5462', 'Andrisunardi25!', 1, 2, 'S3 CCTV', 'Buatlah diri anda dan keluarga merasa aman di rumah, ataupun tempat usaha anda tanpa ada kekhawatiran seseorang yang tidak diundang masuk. S3 CCTV akan memantau setiap sisi rungan, baik didalam maupun di luar rumah atau tempat usaha anda.', 'http://www.s3-cctv.com', 500000, 'logo-s3-cctv.webp', 's3-cctv-1.webp', 's3-cctv-2.webp', 's3-cctv-3.webp', 's3-cctv-4.webp', 's3-cctv-5.webp', 'Website DIW ini sangat baik dirancang dan dipublish. Dulu saya hanya menjual lewat toko secara offline. Tapi sekarang saya bisa menjualnya dan mempromosikan nya secara Online\n\nKamera CCTV kami menjadi sangat laku dan dikenal oleh masyarakat. Jika anda berminat mempromosikan jualan anda, boleh kontak ke teman saya ini.\n\nSemoga sukses usaha jasa buat website nya.\nGood Luck DIW.', '', '2021-10-03', '2015-09-16 07:00:00', '', 1, 's3-cctv', '2015-09-15 03:00:00', '2020-11-07 15:03:42', NULL),
(10, 'PORTFOLIO000010', 7, 7, 'apod4136', 'Andrisunardi25!', 1, 1, 'Apostolic City Church', 'By the grace and mercy of the Lord Jesus, <u><strong>GBI ACC</strong></u> has been established since October 9th, 2005 in a commercial Mall Metropolis Tangerang with Vision \"Building a church sanctuary, mature, and experienced a breakthrough\" so that we could be able to:\n\n1. Transform The Communities\n2. Influence The Cities\n3. Impact The Nations.', 'https://www.apostoliccitychurch.org', 604821, 'logo-apostolic-city-church.webp', 'apostolic-city-church-1.webp', 'apostolic-city-church-2.webp', 'apostolic-city-church-3.webp', 'apostolic-city-church-4.webp', 'apostolic-city-church-5.webp', 'Dengan adanya website Apostolic City Church, jemaat dapat melihat informasi dan kegiatan berlangsung.\nTerima kasih saudara Andri yang sudah membuatkan website Gereja Kita ini.\n\nGod Bless You.', '', '2017-10-05', '2015-10-01 07:00:00', '', 1, 'apostolic-city-church', '2015-09-30 03:00:00', '2020-11-07 15:03:42', NULL),
(11, 'PORTFOLIO000011', 2, 9, 'cekw1848', 'Andrisunardi25!', 1, 1, 'Cek Resi', 'Cek Resi All-in-One: Tracking JNE, TIKI, POS, EMS, Sicepat, Nex Logistic, Lion Express, Tikindo, ESL, Wahana, Pahala, Pandu, Citoxpress, Pos Laju, Skynet', 'http://www.cekresi.co', 1500000, 'logo-cek-resi.webp', 'cek-resi-1.webp', 'cek-resi-2.webp', 'cek-resi-3.webp', 'cek-resi-4.webp', 'cek-resi-5.webp', 'Cekresi.co ternyata meningkatkan google adsense saya.. Berkat diw tadinya hanya beberapa pengunjung, sekarang jadi ribuan Dan HTML5 nya juga bagus, lewat HP juga bagus websitenya.. Teruslah berkarya DIW, thx for ANDRI SUNARDI', '', '2016-11-20', '2015-11-19 07:00:00', '', 1, 'cek-resi', '2015-11-18 03:00:00', '2020-11-07 15:03:42', NULL),
(12, 'PORTFOLIO000012', 2, 8, 'skyt4631', 'Andrisunardi25!', 1, 1, 'Skylite Surya Internusa', 'Pada Tahun 2004 Tia Tian Po mendirikan PT. Skylite Surya Internusa di Daerah Tangerang karena dahulu sangat sedikit persaingan di industri lampu Led sehingga kami pun bekerja sama dengan perusahaan Philips sebuah perusahaan yang khusus memproduksi LED Saving Energy Lamp dan produknya dapat diterima di mancanegara.\n\nDengan dukungan dari perusahaan raksasa tersebut sejak tahun 2004 PT.Skylite Surya internusa memasarkan Led Saving energy Lamp merk â€œSKYLITEâ€ di Indonesia,\n\nSebagai Distributor Lampu LED MERK â€œSKYLITEâ€ Perusahaan kami telah Dipercaya Oleh Perusahaan Swasta Maupun milik Negara, LED Saving energy lamps sangat membantu perusahaan didalam penghematan energy listrik yang otomatis dalam penghematan biaya oprasional yang cukup baik. ', 'http://www.skylitesuryainternusa.com', 1300000, 'logo-skylite-surya-internusa.webp', 'skylite-surya-internusa-1.webp', 'skylite-surya-internusa-2.webp', 'skylite-surya-internusa-3.webp', 'skylite-surya-internusa-4.webp', 'skylite-surya-internusa-5.webp', 'Saya di kenalkan dari temen saya ini si agan Andri Sunardi\nDia sudah membuat banyak website, mulai dari offline dan online.\n\nDIW memang bagus-bagus websitenya. Pengerjaannya juga ga lama, hanya sekitar 3 minggu jadi.\nMemang banyak revisi dari saya.\n\nPelayanan ama berkelas website mas Andri\nSukses selalu mas Andri', '', '2016-11-25', '2015-10-08 07:00:00', '', 1, 'skylite-surya-internusa', '2015-10-07 03:00:00', '2020-11-07 15:03:42', NULL),
(13, 'PORTFOLIO000013', 14, 12, '', '', 1, 1, 'Travelment', 'Travelment.com adalah situs penjualan tiket bus, shuttle, dan travel online terbesar di Indonesia yang dimiliki dan dioperasikan oleh PT Media Baru Digital. Saat ini sudah ada puluhan operator penyedia jasa transportasi darat seperti Perusahan Otobus (PO), shuttle dan travel dan terus bertambah. Travelment melayani beragam rute dari dan ke berbagai tujuan di Indonesia.\n\nSelain akses melalui website, Travelment juga akan segera hadir dalam bentuk aplikasi mobile di Google Playstore untuk smartphone Android dan Appstore untuk smartphone iOS Apple sehingga akan lebih memudahkan Anda untuk membeli tiket kapan pun dan dimana pun.\n\nTravelment memiliki tim yang professional dan handal dengan pengalaman lebih dari 10 tahun di industri website dan online di Indonesia. Travelment juga didukung oleh pendanaan yang sangat kuat yang dibutuhkan untuk memasarkan dan mengenalkan website Travelment ke seluruh masyarakat Indonesia.\n\nTravelment juga memiliki tim Customer Service yang siap melayani semua pertanyaan, komentar maupun keluhan 24 jam setiap harinnya. Kami siap untuk membantu semua kebutuhan Anda yang berhubungan dengan beli tiket bus, shuttle maupun travel di Indonesia.', '', 1500000, 'logo-travelment.webp', 'travelment-1.webp', 'travelment-2.webp', 'travelment-3.webp', 'travelment-4.webp', 'travelment-5.webp', 'Profesional, project diselesaikan sebelum deadline. Harga bersahabat, hasilpun hebat.\n\nSemoga ke depannya dapat bekerja sama lagi.', '', NULL, '2016-01-02 07:00:00', '', 1, 'travelment', '2016-01-01 03:00:00', '2020-11-07 15:03:42', NULL),
(14, 'PORTFOLIO000014', 2, 13, '', '', 0, 1, 'Sinar Bhakti Perkasa', 'PT. Sinar Bhakti Perkasa didirikan pada tahun 2004 dengan pemilik perusahaan yang bernama  Herman Otang. Perusahaan ini merupakan salah satu perusahaan yang bergerak dalam bidang general kontraktor di Indonesia yang menawarkan jasa-jasa dalam seputar kegiatan kontraktor.\n\nPerusahaan ini selalu ingin memaksimalkan kinerja mereka dalam segi apapun, dan salah satunya dalam segi kualitas jasa yang ditawarkan dan pelayanan yang disajikan untuk konsumen sehingga perusahaan ini bisa memiliki pelanggan yang cukup banyak dan memperoleh omset perbulan hingga Rp. 250.000.000.\n\nPT. Sinar Bhakti Perkasa terletak di Jalan Merdeka Komplek Perum Pabuaran Indah Blok B nomor 1-2 Tangerang Pada awal mulanya perusahaan ini hanya memepekerjakan keluarga mereka, hingga sampai saat ini mereka sudah bisa merekrut karyawan-karyawan untuk menunjang proses bisnis PT. Sinar Bhakti Perkasa yang berjumalah sekitar 120 orang.', '', 2500000, 'logo-sinar-bhakti-perkasa.webp', 'sinar-bhakti-perkasa-1.webp', 'sinar-bhakti-perkasa-2.webp', 'sinar-bhakti-perkasa-3.webp', 'sinar-bhakti-perkasa-4.webp', 'sinar-bhakti-perkasa-5.webp', 'Thx buat andri dengan jasa webnya, web yang gw mw bisa tercapai walaupun dengan deadline yg pendek, tapi semua komponen yang diinginkan bisa tercapai..\n\nRecomen bgt deh buat yg pingin nyari jasa web, dan bisa langsung konsultasi sama orgnya tanpa ribet', '', NULL, '2016-01-09 07:00:00', '', 1, 'sinar-bhakti-perkasa', '2016-01-08 03:00:00', '2020-11-07 15:03:42', NULL),
(15, 'PORTFOLIO000015', 18, 14, 'u360099169_user', 'kayakita.com', 1, 1, 'Kaya Kita', 'KayaKita adalah sebuah bisnis yang memberikan banyak promo-promo menarik dari berbagai macam vendor yang bekerja sama.\n\nMulai dari Kuliner, Pendidikan, Fashion, Travelling, Wahana Bermain, Hiburan, Kesehatan & Kecantikan.\n\nPromo tersebut berbede-beda setiap bulannya dan dapat dinikmati oleh seluruh anggota bisnis komunitas KayaKita.\n\nSyarat : Wajib Qualified. (Sudah memiliki 3 Partner/Downline) Untuk menikmati berbagai macam promo-promo menarik yang berbeda setiap bulannya.\n\n-JALANKAN BISNISNYA & NIKMATI PROMO-PROMONYA-', 'http://www.kayakita.com', 5000000, 'logo-kaya-kita.webp', 'kaya-kita-1.webp', 'kaya-kita-2.webp', 'kaya-kita-3.webp', 'kaya-kita-4.webp', 'kaya-kita-5.webp', 'Keahlian programmer Develop Inspire Website (DIW) yang sangat handal mampu menciptakan sistem-sistem yang anda inginkan pada website anda.\n\nWaktu pengerjaannya tidak lama bahkan, terbilang sangat cepat dan programmer DIW selalu siap untuk membantu mengembangkan ide untuk kesempurnaan sistem pada website anda.\n\nSangat direkomendasikan bagi anda yang ingin menciptakan website dengan kualitas jempolan dan desain yang elegan.\n\n-Kenny- (Founder KayaKita)', '', '2017-03-04', '2016-03-04 07:00:00', '', 1, 'kaya-kita', '2016-05-02 03:00:00', '2020-11-07 15:03:42', NULL),
(16, 'PORTFOLIO000016', 1, 15, '', '', 1, 1, 'PT Sinar Bhakti Perkasa', 'PT Sinar Bhakti Perkasa didirikan oleh Herman Otangpada tahun 2005.PT Sinar Bhakti Perkasa adalah perusahaan yang bergerak di bidang General Contractor, Supplier, & Heavy Equipment, sebelumnya bernama PD Sinar Bakti yang berdiri pada tahun 1985 di Jl Merdeka Raya Perum, Pabuaran Indah Blok A No.4 Tangerang, yang kemudian berkembang dan berubah nama menjadi PT Sinar Bhakti pada tahun 2005. Pada saat itu perusahaan dibidang kontraktor terhitung jarang. Hal ini sangat mendukung perkembangan PT Sinar Bhakti Perkasa untuk terus berkembang pada saat itu.\n\nHingga sekarang ini, proyek-proyek yang ditangani termasuk besar di Kota Tangerang, dan banyak proyek-proyek yang ditangani oleh PT Sinar Bhakti Perkasa. Selain proyek-proyek yang ditangani, PT Sinar Bhakti Perkasa juga menyewakan berbagai alat seperti: Excavator Hitachi, Vibro, Buldosser, Excavator Kobelko, dan lainnya. Dan PT Sinar Bhakti juga menyewakan mobilisasi yaitu: Trailler yang juga di butuhkan untuk mengirim alat-alat tersebut ke lokasi tujuan dan Dump Truck Tronton yang digunakan untuk mengambil dan buangan tanah di setiap proyek serta material-material seperti: Batu Mahkadam, Split, Pasir, Abu Batu, dan lainnya. PT Sinar Bhakti Perkasa awal mulanya dibidang cut and fill, Stripping, dan sekarang mulai berkembang dibidang Kontruksi.', '', 500000, 'logo-pt-sinar-bhakti-perkasa.webp', 'pt-sinar-bhakti-perkasa-1.webp', 'pt-sinar-bhakti-perkasa-2.webp', 'pt-sinar-bhakti-perkasa-3.webp', 'pt-sinar-bhakti-perkasa-4.webp', 'pt-sinar-bhakti-perkasa-5.webp', 'Good Job Andri, bro yang satu ini teman kampus saya. Sorry ya dri kalau saya minta revisi terus.\nSukses terus usaha jasa websitenya', '', NULL, '2016-04-01 07:00:00', '', 1, 'pt-sinar-bhakti-perkasa', '2016-03-31 03:00:00', '2020-11-07 15:03:42', NULL),
(17, 'PORTFOLIO000017', 18, 14, 'kiosmbc89', 'kiosmbc.com', 1, 1, 'Kios MBC', 'Salah satu peluang bisnis yang akan selalu tumbuh adalah sektor pariwisata baik wisata dalam negeri maupun luar negeri. Di mana jumlah wisatawan yang bepergian ke luar negeri selalu meningkat tiap tahunnya. Begitu pula sebaliknya jumlah wisatawan yang masuk ke Indonesia juga selalu meningkat tiap tahunnya, lebih dari 700.000 orang perbulan datang ke Indonesia (sumber : bps.go.id)\n\nMelihat peluang emas tersebut maka empat orang yang menamai diri mereka Young Executive Travelpreneur bersepakat dan bersemangat untuk bersama - sama mendirikan suatu usaha Tour and Travel.\n\nTidak hanya sebagai layanan Tour and Travel saja, pada bisnis yang didirikan ini ada pula inovasi yang dihadirkan seperti layanan PPOB, layanan pembayaran PLN, PAM, BPJS, Pulsa All Operator, UMROH, dan ke depan akan semakin banyak lagi inovasi yang akan dihadirkan.\n\nTak berhenti disitu saja, keempat Young Executive Travelpreneur tersebut juga ingin berbagi manfaat dan profit dengan masyarakat luas sebagai bentuk dukungan terhadap kemajuan ekonomi bangsa dengan membuka kemitraan peluang bisnis Tour and Travel dengan harga sangat terjangkau namun hasil yang maksimal.\n\nSelain itu, untuk lebih mendukung terciptanya para Travelpreneur yang luar biasa di Indonesia, juga disediakan pelatihan Exclusive bersama Executive Trainer dan Business Coach yang handal untuk semakin meningkatkan profit para mitra yang ada.', 'http://www.kiosmbc.com', 1000000, 'logo-kios-mbc.webp', 'kios-mbc-1.webp', 'kios-mbc-2.webp', 'kios-mbc-3.webp', 'kios-mbc-4.webp', 'kios-mbc-5.webp', 'Develop Inspire Website :\nSistem KIOSMBC yang sangat luar biasa dapat diciptakan oleh Programmer DIW hanya dalam waktu 2 minggu. Desain yang elegan selalu menjadi ciri khas dari website-website yang dibuat oleh DIW. Setelah website jadi, DIW terus melakukan maintenance terhadap website tersebut untuk memastikan sistem di website tersebut benar-benar sempurna.\n\nKesimpulan, DIW memiliki programmer yang luar biasa handal dan professional serta paham akan nilai-nilai estetika seni karena dalam website yang dibuat oleh DIW selalu tercermin beberapa elemen-elemen estetika seni.\n\n-Kenny- (Founder KIOSMBC)', '', '2017-04-28', '2016-04-12 07:00:00', '', 1, 'kios-mbc', '2016-04-11 03:00:00', '2020-11-07 15:03:42', NULL),
(18, 'PORTFOLIO000018', 1, 16, '', '', 1, 1, 'Klinik Dokter Gigi Drg Titin Sumarni', 'Praktek Dokter Gigi drg.Titin Sumarni berdiri pada tahun 2003 sampai dengan sekarang yang berlokasi di Jl. Iskandar Muda no.28 Sewan Neglasari Tangerang Banten, drg.Titin Sumarni lulusan dari Universitas Trisakti Jakarta pada tahun 1999. Setelah lulus saya ditugaskan pada ikatan dinas pemerintah di puskesmas Tilamuta, Gorontalo selama 2 tahun. Pada tahun 2001 saya sempat bergabung di Klinik 24 jam di Kebon Nanas Tangerang sampai tahun 2003 dan akhirnya mulai merintis praktek gigi sendiri yang dimulai dari nol dengan keterbatasan yang ada. Kini saya sudah memilik ratusan pasien yang selalu datang ke tempat praktek gigi saya. a.Visi 1)Bekerja memberikan yang terbaik buat Tuhan Yesus. 2)Melayani pasien sesuai dengan etika kedokteran gigi yang berlaku. b.Misi 1)Agar pasien menyadari pentingnya menjaga dan merawat kebesihan gigi dan mulut.', '', 1500000, 'logo-klinik-dokter-gigi-drg-titin-sumarni.webp', 'klinik-dokter-gigi-drg-titin-sumarni-1.webp', 'klinik-dokter-gigi-drg-titin-sumarni-2.webp', 'klinik-dokter-gigi-drg-titin-sumarni-3.webp', 'klinik-dokter-gigi-drg-titin-sumarni-4.webp', 'klinik-dokter-gigi-drg-titin-sumarni-5.webp', 'Andri, terima kasih untuk programnya Saya senang sekali di bantu oleh agan Andri Sesuai dengan perkiraan yang mau ane buat websitenya Thank you bro!', '', NULL, '2016-04-18 07:00:00', '', 1, 'klinik-dokter-gigi-drg-titin-sumarni', '2016-04-17 03:00:00', '2020-11-07 15:03:42', NULL),
(19, 'PORTFOLIO000019', 3, 17, 'sakm3476_sakura', 'Andrisunardi280195!', 1, 2, 'Sakura Kita', 'Sakurakita - Kita Bangun Indonesia Walau dari Negeri Sakura.\n\nMedia Bisnis dan Informasi khusus masyarakat Indonesia yang berada di Jepang maupun di Indonesia. Bersama Sakurakita membangun Indonesia walau dari negeri Sakura.', 'http://www.sakurakita.com', 4000000, 'logo-sakura-kita.webp', 'sakura-kita-1.webp', 'sakura-kita-2.webp', 'sakura-kita-3.webp', 'sakura-kita-4.webp', 'sakura-kita-5.webp', 'Thank you bro Andri Sunardi\nGa kecewa dengan ente gan\nAne cek portfolio sebelum ane beli jasa di ente, cakep2 semua\n\nGa mengecewakan lah, revisi2nya juga diselesaikan dengan baik dan dengan sesuai konsep ane dari awal\nSorry ya bro kl respon ane agak telat\n-Rio', '', '2017-04-27', '2016-04-27 07:00:00', '', 1, 'sakura-kita', '2016-04-26 03:00:00', '2020-11-07 15:03:42', NULL),
(20, 'PORTFOLIO000020', 1, 18, '', '', 0, 1, 'Universitas Maju Jaya', 'Aplikasi Pengisian KRS Online yang dapat di isi oleh mahasiswa Universitas Maju Jaya tanpa harus datang ke kampus dan dapat dicetak KRS nya.\nDengan adanya aplikasi KRS Online, mahasiswa lebih mudah mengisi KRS mereka.', '', 500000, 'logo-universitas-maju-jaya.webp', 'universitas-maju-jaya-1.webp', 'universitas-maju-jaya-2.webp', 'universitas-maju-jaya-3.webp', 'universitas-maju-jaya-4.webp', 'universitas-maju-jaya-5.webp', 'Terima kasih ya andri , yang sudah membantu saya membuat program aplikasi sistem informasi kampus KRS.\n\nAplikasinya sesuai dengan request permintaan saya melalui use case yang saya berikan.\nSemangat terus andri dan usaha DIW nya.', '', NULL, '2016-05-31 07:00:00', '', 1, 'universitas-maju-jaya', '2016-05-30 03:00:00', '2020-11-07 15:03:42', NULL),
(21, 'PORTFOLIO000021', 1, 20, '', '', 0, 1, 'PT Jalur Sejuk', 'We take this opportunity to introduce you our company, PT. JALUR SEJUK, a wholly -owned national company established mainly to serve the development of manufacturing insulation panels for Cold rooms & Telecommunication Shelter Cabin, stocking in refrigeration parts, designing walk- in industrial and commercial cold store warehouses. The company is willing to co work with others in the industries with the aim to supply and to give the best service to end users, telecommunication sectors, food traders, restaurants, hotels, food distribution centers, hospitals, on land and marine cold storage systems.\n\nOur factory is located in the industrial estate of Tangerang, 30 km of Central Jakarta, and has and overall staff of 60 people. We are capable of producing a single length panel of up to 12 m, with thickness of 50 mm up to 200 mm in 25 mm increment. The insulation is injected with the latest high-pressure injection capacity machine using environmentally friendly raw materials.\n\nPT. Jalur Sejuk is supported by professional manpower competent in their disciplines together with years of practical experience on insulation panelâ€™s production and sales of refrigeration equipmentâ€™s.\n\nWe offer a full range of profesional service in :\nâ€¢ Manufacturing polyurethane insulation panels.\nâ€¢ Manufacturing Kitchen and Stainless Steel Fabrication.\nâ€¢ Manufacturing (Custom made) Ice Block Plant.\nâ€¢ Stockiest of Refrigeration & Air conditioning spare parts, Tools, Condensing Unit, etc.\nSupervision and inspection of cold store, freezer, and associated equipment\nâ€¢ Commissioning of complete cold store, freezer and related refrigeration plants.\nâ€¢ Commisioning of ME & CKD Shelter for telecomunication application.', '', 1500000, 'logo-pt-jalur-sejuk.webp', 'pt-jalur-sejuk-1.webp', 'pt-jalur-sejuk-2.webp', 'pt-jalur-sejuk-3.webp', 'pt-jalur-sejuk-4.webp', 'pt-jalur-sejuk-5.webp', 'Puji Tuhan bgt..\nThanks ko programny..', '', NULL, '2016-06-07 07:00:00', '', 1, 'pt-jalur-sejuk', '2016-06-06 03:00:00', '2020-11-07 15:03:42', NULL),
(22, 'PORTFOLIO000022', 1, 19, '', '', 0, 1, 'PT Daliny Guna Usaha', 'PT. Daliny Guna Usaha adalah salah satu perusahaan yang berkembang di bidang distributor-retail produk-produk souvenir, hadiah, stationery dan tas anak yang cukup terkemuka di daerah Jakarta. Didirikan pada tahun 1987 oleh Ibu Lily selaku Owner dan dikembangkan oleh Bapak Erwin Kusnadi selaku Direktur Operasional. PT. Daliny Guna Usaha mempunyai 3 gudang yang tersebar di daerah Jabotabek dan memiliki 2 ruko yang digunakan sebagai kantor  2 unit Ruko yang digunakan sebagai kantor yang terletak di Jl. Raya Kebayoran Lama No. 39 B-C, Jakarta 12210 dengan memperkerjakan sekitar 26 karyawan yang berperan pada bagian FAD, Marketing, Personalia, 22 orang pada bagian gudang dan memiliki 150 karyawan yang diperkerjakan sebagai pramuniaga (SPG).\n\nSeluruh barang yang di jual oleh PT. Daliny Guna Usahanya mendapatkan lisensi dari masing-masing vendor. Sejauh ini PT. Daliny Guna Usaha sudah mengantongi 20 lisensi diantaranya Sanrio, Minnion, Angry Bird, Disney Tsum Tsum dan masih banyak lagi.\n\nPT. Daliny Guna Usaha memiliki 6 Toko yang berada di mal besar daerah Jakarta yang dinamakan Familia dan Sanrio Gift gate. PT. Daliny Guna Usaha juga memasok ke department store terkemuka di seluruh Indonesia seperti Matahari, Centro, Gramedia dan masih banyak lagi yang jumlahnya kurang lebih 150 counter dan dengan pengiriman barang dengan rata-rata nominal bruto kurang lebih Rp 35.000.000,-  per hari.', '', 1500000, 'logo-pt-daliny-guna-usaha.webp', 'pt-daliny-guna-usaha-1.webp', 'pt-daliny-guna-usaha-2.webp', 'pt-daliny-guna-usaha-3.webp', 'pt-daliny-guna-usaha-4.webp', 'pt-daliny-guna-usaha-5.webp', 'Thanks ko atas pembuatan programnya\nSemuanya berjalan baik-baik saja', '', NULL, '2016-06-07 07:00:00', '', 1, 'pt-daliny-guna-usaha', '2016-06-06 03:00:00', '2020-11-07 15:03:42', NULL),
(23, 'PORTFOLIO000023', 1, 21, '', '', 1, 1, 'Prediksi Angka', 'Prediksi Angka dengan memasukan 6 data berupa x1, x2, dan y, lalu di proses mulai dari menjumlahnya nilai Y, matriks 6x6, proses TETA, dan hasil new_c1, new_c2,new_c3, new_c4, new_a1, new_a2, new_a3, new_a4. Setelah di kalkulasi, menginput nilai new x1, x2, dan di proses untuk data new y.', '', 2000000, 'logo-prediksi-angka.webp', 'prediksi-angka-1.webp', 'prediksi-angka-2.webp', 'prediksi-angka-3.webp', 'prediksi-angka-4.webp', 'prediksi-angka-5.webp', 'makasih gan atas bantuannya..\nrespone jelas.. recomended nih \n\ncendol send', 'https://fjb.kaskus.co.id/show_post/576cba9762088166788b4575/4/', NULL, '2016-06-11 07:00:00', '', 1, 'prediksi-angka', '2016-06-10 03:00:00', '2020-11-07 15:03:42', NULL),
