(28, 'PORTFOLIO000028', 2, 30, 'metj9916', 'krocolat0z', 1, 1, 'MJ AMENITIES', 'Metalindojaya adalah sebuah perusahaan yang bergerak di bidang distribusi atau amenities penyedia kebutuhan hotel dan rumah sakit. Kami sangat menjaga kualitas kami dan berusaha untuk selalu mengirim barang tepat pada waktu yang telah di tentukan. ', 'https://www.metalindojaya.com', 2000000, 'logo-mj-amenities.webp', 'mj-amenities-1.webp', 'mj-amenities-2.webp', 'mj-amenities-3.webp', 'mj-amenities-4.webp', 'mj-amenities-5.webp', 'Untuk teman saya Andri Sunardi...\nBisa terima desain dari luar walau gk 100% mirip tapi bisa di kembangin lagi menjadi elegan dan terlihat rapih\nDesainnya juga cukup baik dan HTML5.\nThanks andri.', '', '2025-08-13', '2016-08-15 00:00:00', '', 1, 'mj-amenities', '2016-08-13 20:00:00', '2020-11-07 15:03:42', NULL),
(29, 'PORTFOLIO000029', 8, 31, 'harz2591', 'DevelopInspireWebsite2016!', 1, 1, 'Harga Toyota Terbaru', 'Website resmi Toyota Indonesia. Mobil terbaik, irit, dengan pelayanan purna jual terbaik dan jaringan dealer dan bengkel terluas di Indonesia.\n\nKontak Kami\nAlamat: Jl. Raya Merdeka No. 80, Cimone, Tangerang 15114\nTelepon: 089 505 707 476\nEmail: steven.fransiskus@yahoo.com\nFacebook: https://www.facebook.com/tunastoyotatangerang (Harga Terbaru Toyota)\nWeb: www.hargatoyotaterbaru.com', 'https://www.hargatoyotaterbaru.com', 2000000, 'logo-harga-toyota-terbaru.webp', 'harga-toyota-terbaru-1.webp', 'harga-toyota-terbaru-2.webp', 'harga-toyota-terbaru-3.webp', 'harga-toyota-terbaru-4.webp', 'harga-toyota-terbaru-5.webp', 'Websitenya bagus kok, terlihat elegant dan bagus seperti website resmi\nKalah jasa website lain dah.. Pokoknya DIW topcer..\n\nThanks Andri, tetap semangat dan sukses jasa buat website nya.', '', '2018-08-26', '2016-08-26 00:00:00', '', 1, 'harga-toyota-terbaru', '2016-08-24 20:00:00', '2020-11-07 15:03:42', NULL),
(30, 'PORTFOLIO000030', 1, 18, '', '', 0, 1, 'Dasana Indah Tangerang', 'Warga Perumahan Dasana Indah, khususnya RT 002 RW 015 adalah warga yang menetap di wilayah RT 002 yang diresmikan, diputuskan dan ditetapkan oleh Kepala Kelurahan Bojong Nangka, Kecamatan Kelapa Dua Tangerang yang di pimpin oleh H. Yayat Rohiman.\n\nKedudukan dan Status Warga RT 002/015 adalah warga yang menetap dan tinggal di wilayah RT 002/015, baik dirumah milik sendiri atau pun kontrak.\n\nAdapun Kebijakan Pindahan dari RT 002/015 sebagai berikut:\n1. Warga yang pindah keluar wilayah RT 002 diwajibkan melapor ke pengurus RT 002 dan membuat surat pindah dari RT 002 RW 015\n2. Warga yang pindah keluar wilayah RT 002, bukan lagi warga RT 015.\n3. Warga yang masih memiliki kartu tanda penduduk RT 002, tetapi tidak lagi tinggal di wilayah RT 002 bukan warga RT 002.\n4. Dalam hal-hal tertentu ketua RT berhak mengambil kebijakan.', '', 2500000, 'logo-dasana-indah-tangerang.webp', 'dasana-indah-tangerang-1.webp', 'dasana-indah-tangerang-2.webp', 'dasana-indah-tangerang-3.webp', 'dasana-indah-tangerang-4.webp', 'dasana-indah-tangerang-5.webp', 'Thanks ya andri, berkat u gw jadi selesai penulisannya dan di bantu2 juga ampe softcover plus CD nya. Programnya juga sesuai ama yang gw mau dan dosen juga. Sukses terus usaha u dri.', '', NULL, '2016-09-28 05:07:00', '', 1, 'dasana-indah-tangerang', '2016-09-27 01:07:00', '2020-11-07 15:03:42', NULL),
(31, 'PORTFOLIO000031', 14, 32, 'apod4136', 'Andrisunardi25!', 1, 1, 'Studiolife Music Studio', 'Studiolife kami dirikan pada tahun 2011 dan beroperasi hingga saat ini. Fokus utama kami adalah untuk menyediakan ruangan serta alat-alat musik yang berkualitas agar anda para pemusik dapat menyalurkan bakat dan hobi anda dengan leluasa di studio kami. Kami juga berkomitmen untuk memberikan pelayanan yang optimal kepada anda, para pelanggan setia kami.', 'http://www.studiolife.web.id', 2200000, 'logo-studiolife-music-studio.webp', 'studiolife-music-studio-1.webp', 'studiolife-music-studio-2.webp', 'studiolife-music-studio-3.webp', 'studiolife-music-studio-4.webp', 'studiolife-music-studio-5.webp', 'Gw ga mau banyak omong, ga mau banyak kata2, cuma 1 kata yang pantes setelah transaksi bikin web sama bro Andri Sunardi.. yaitu P-U-A-S!!!\n\nGimana ga puas, web pesenan sesuai request, gw maunya kyak gimana, dy bikin persis kyak yg gw mau..\n\nGa ribet, ga banyak neko2, tau2 web gw udah kelar aje.. bhahahaha..\nSoal harga really-really-really worth it setiap sen nya..\n\nPkoknya super sekali lah bro Andri Sunardi! Thanks berat broo...\n\n(nb: sering2 ya bikinin gw nutrisari kalo gw maen ksana.. wkwkwk)\n\nSukses terus broo.. DIW really inspired me!\n\n<a draggable=\"false\" href=\"https://www.facebook.com/diw.co.idd/posts/1190029421044597\" target=\"_blank\">Facebook Comment</a>\n\n<a draggable=\"false\" href=\"https://www.facebook.com/frostocktwo/posts/1144099332309189\" target=\"_blank\">Facebook Review</a>', 'https://www.facebook.com/frostocktwo/posts/1144099332309189', '2017-12-24', '2016-09-29 00:00:00', '', 1, 'studiolife-music-studio', '2016-09-27 20:00:00', '2020-11-07 15:03:42', NULL),
(32, 'PORTFOLIO000032', 1, 33, '', '', 0, 1, 'PT Cometa Can', '<b>PT Cometa Can</b>\nCometa Can adalah produsen kemasan kaleng yang biasa digunakan untuk general product dan food product (processed food dan dry food). Kemasan kaleng dibuat dalam berbagai bentuk dan ukuran baik polos maupun dicetak dengan aneka ragam warna dan didisain secara kreatif dan inovatif sehingga memberikan nilai jual yang tinggi terhadap produk yang dikemas.\n\n<b>Latar Belakang</b>\nPara pendiri Cometa Can mengawali usahanya dibidang perdagangan umum dan export-import pada tahun 1953. Dalam perkembangan usahanya, pada tahun 1965 salah satu divisi dari Cometa memantapkan diri menjadi pemasok tinplate (bahan baku kaleng) terbesar nasional pada saat itu. Kesuksesan ini menjadi titik tolak diversifikasi usaha perusahaan yang mendapatkan status PMDN pada tahun 1973 dan pada tahun 1975 menjadi PT. Cometa Can Corporation ( Cometa Can ).\n\nPada awalnya Cometa Can hanya berkonsentrasi pada produksi general can. Memasuki era tahun 80-an Cometa Can mulai meluaskan produksinya ke produk processed food can dan Dry food can sampai saat ini.\n\nBerkat dukungan serta kepercayaan dari para pelanggan selama lebih dari 3 dekade, Cometa Can telah menjelma menjadi salah satu produsen terbesar dalam industri kemasan kaleng nasional.', '', 2300000, 'logo-pt-cometa-can.webp', 'pt-cometa-can-1.webp', 'pt-cometa-can-2.webp', 'pt-cometa-can-3.webp', 'pt-cometa-can-4.webp', 'pt-cometa-can-5.webp', 'sukses terus untuk DIW, semoga ke depan bisa lebih maju, lebih berkembang menjadi mitra bisnis yang handal dalam bidang jasa pembuatan website.\nThanks for DIW Website', '', NULL, '2016-10-12 00:00:00', '', 1, 'pt-cometa-can', '2016-10-10 20:00:00', '2020-11-07 15:03:42', NULL),
(33, 'PORTFOLIO000033', 1, 47, 'smas8126', 'DevelopInspireWebsite2017!', 0, 1, 'SMA Santa Maria Della Strada', 'SMA Santa Maria Della Strada adalah sekolah Katolik milik Paroki Santo Alfonsus Rodrigues di bawah naungan Yayasan Pendidikan Umum Santo Lukas. Dan mulai beroperasi pada tahun 2000/2001 Terakreditasi â€œAâ€.\n\nLokasi SMA Santa Maria Della Strada Jakarta berada di Jalan Pademangan I Gang 7 Nomor 18 jakarta Utara. Secara umum kondisi ekonomi siswa SMA Santa Maria Della Strada dipengaruhi oleh kondisi sosial sehingga terdapat disparitas yang nyata.\n\nVISI\nMENJADI MANUSIA YANG BERPRESTASI, INOVATIF,\nDAN \nMANDIRI BERDASARKAN CINTA KASIH\n\nMISI\n1. Meningkatkan prestasi dalam bidang akademik dan non-akedemik.\n2. Mengembangkan potensi siswa.\n3. Meningkatkan kemandiran dalam belajar dan bertindak.\n4. Menumbuhkembangkan kepedulian.', 'http://www.smasantamariadellastrada.com', 5000000, 'logo-sma-santa-maria-della-strada.webp', 'sma-santa-maria-della-strada-1.webp', 'sma-santa-maria-della-strada-2.webp', 'sma-santa-maria-della-strada-3.webp', 'sma-santa-maria-della-strada-4.webp', 'sma-santa-maria-della-strada-5.webp', 'Makasih ya ko udah dibuatn programnya basis website kita. Nanti kalau ada project skripsi lagi, pasti saya kabarin. Thank you ko.', '', '2018-01-25', '2016-10-21 00:00:00', '', 1, 'sma-santa-maria-della-strada', '2016-10-19 20:00:00', '2020-11-07 15:03:42', NULL),
(34, 'PORTFOLIO000034', 11, 34, 'tunm1387', 'DevelopInspireWebsite2016!', 1, 1, 'Tungkal Punye', 'Tungkal Punye adalah Perusahaan yang bergerak di bidang Jasa Penyewaan Papan Bunga, Kipas Angin Blower, Lampu Hias, LED, Lampu Sorot, Proyektor, Mesin Genset 8.000watt, baju khas Tungkal, dan menyediakan berbagai macam sovenir khas tungkal.\n\nTungkal Punye\nMr FL Production\n\nSenin - Sabtu: 08.00â€“12.00, Minggu Libur\nJalan Panglina H. Saman RT 17. No. 029, Kualatungkal, Jambi, Indonesia\n\nTelepon: 08 5266 818 395\nGmail: andryfaisalyfm@gmai.com\nEmail: tungkalpunye@gmail.com\nWebsite: www.tungkalpunye.com\n\nFacebook: Kaos Tungkal Punye\nFacebook: Tungkal Florist\nInstagram: tungkal_kaos\nInstagram: tungkal_punye', 'https://www.tungkalpunye.com', 2500000, 'logo-tungkal-punye.webp', 'tungkal-punye-1.webp', 'tungkal-punye-2.webp', 'tungkal-punye-3.webp', 'tungkal-punye-4.webp', 'tungkal-punye-5.webp', 'Ane bingung gan ngisi testimoninya. Soalnya saya banyak permintaan dari agan. Dari background, pengaturan warna, ukuran, dan masih banyak deh gan. Dan juga sebelum deal, agan sabar ngadepin pertanyaan2 ane yang mungkin ane kurang paham di bidang website.\n\nPelayanan agan Andri ini kalau begini terus, pasti banyak yang beli jasa di ente gan. Salut ane gan sama ente punya usaha jasa website. Thank you dah bozz atas kerjasamanya.. -Tungkal Punye', 'https://www.facebook.com/kaosdistro.tungkalpunye/posts/219977371758533', '2017-10-31', '2016-10-30 00:59:00', '', 1, 'tungkal-punye', '2016-10-28 20:59:00', '2020-11-07 15:03:42', NULL),
(35, 'PORTFOLIO000035', 8, 35, 'prot4177', 'DevelopInspireWebsite2016!', 1, 1, 'Promo Baru Toyota', 'Promo Baru Toyota adalah Website Personal Toyota Indonesia yang dibuat untuk kepentingan umum maupun sendiri dalam mereferensikan harga dan informasi mobil Toyota. Semua materi baik berupa gambar, informasi, dan harga mobil Toyota adalah dari Website Resmi Toyota Indonesia www.toyota.astra.co.id untuk disajikan secara detail kepada anda.\n\nDengan adanya website www.promobarutoyota.com, kami berharap agar dapat memberikan manfaat kepada anda.\nTerima Kasih.\n\n<b>Hubungi Kami</b>\nNama: Sandy\nAlamat: Jl. Raya Merdeka No. 80, Cimone, Tangerang 15114 - Indonesia\nTelepon: 0896 6209 5589 (3)\nTelepon: 0812 1305 9812 (Simpati)\nEmail: chin.sandy89@gmail.com\nFacebook: Promo Baru Toyota\nWebsite: www.promobarutoyota.com', 'https://www.promobarutoyota.com', 2200000, 'logo-promo-baru-toyota.webp', 'promo-baru-toyota-1.webp', 'promo-baru-toyota-2.webp', 'promo-baru-toyota-3.webp', 'promo-baru-toyota-4.webp', 'promo-baru-toyota-5.webp', 'Website yg andri buat bagus kece.. salut ane ama anda\nThx web nya\nPromobarutoyota.com ', '', '2017-11-01', '2016-10-31 15:55:00', '', 1, 'promo-baru-toyota', '2016-10-30 11:55:00', '2020-11-07 15:03:42', NULL),
(36, 'PORTFOLIO000036', 7, 385, 'yout3765', 'DevelopInspireWebsite2016!', 1, 1, 'Youth for Christ GBI Pray', 'Komunitas anak muda yang berada dibawah naungan Gereja Bethel Indonesia Pamulang Raya (GBI PRAY) Ibadah setiap hari Sabtu Jam 18.30 WIB Menjangkau dunia dan menjadikan bangsa murid Kristus yang bersedia memuridkan, rela berkorban serta melayani.', 'https://www.youthforchrist-gbipray.com', 2425000, 'logo-youth-for-christ-gbi-pray.webp', 'youth-for-christ-gbi-pray-1.webp', 'youth-for-christ-gbi-pray-2.webp', 'youth-for-christ-gbi-pray-3.webp', 'youth-for-christ-gbi-pray-4.webp', 'youth-for-christ-gbi-pray-5.webp', NULL, NULL, '2018-12-18', '2016-11-03 00:00:00', 'Sicilia Oktaviane', 1, 'youth-for-christ-gbi-pray', '2016-11-01 20:00:00', '2021-03-13 15:44:46', NULL),
(37, 'PORTFOLIO000037', 1, 39, '', '', 0, 1, 'PT Hero Supermarket Tbk', 'HERO Group adalah pelopor di ritel modern yang memiliki banyak toko di Indonesia. HERO Group merupakan perusahaan ritel modern pertama di Indonesia, didirikan pada tahun 1971 oleh almarhum Muhammad Saleh Kurnia di Jl. Falatehan, Jakarta.\n\nHERO Group membuka toko pertamanya di Jakarta pada tahun 1971 dan telah berkembang menjadi salah satu operator terkemuka di Indonesia untuk supermarket, hipermarket, toko kesehatan dan kecantikan, dan toko perabot rumah tangga, mengoperasikan lima merek toko dengan total 465 toko di seluruh Indonesia pada 30 September 2016. Perusahaan telah tercatat di Bursa Efek Indonesia sejak tahun 1989 (Kode Saham: HERO).', '', 2000000, 'logo-pt-hero-supermarket-tbk.webp', 'pt-hero-supermarket-tbk-1.webp', 'pt-hero-supermarket-tbk-2.webp', 'pt-hero-supermarket-tbk-3.webp', 'pt-hero-supermarket-tbk-4.webp', 'pt-hero-supermarket-tbk-5.webp', 'Program yang ko2 buat udah bagus cuma rada berat gara2 data dari saya 5ribu data, jadinya rada lag. But overall oke ko. Terima kasih.', '', NULL, '2016-11-03 00:00:00', '', 1, 'pt-hero-supermarket-tbk', '2016-11-01 20:00:00', '2020-11-07 15:03:42', NULL),
(38, 'PORTFOLIO000038', 2, 24, 'brightclub', '4dm1n-br1ght', 1, 1, 'BrightClub.biz', 'Bright Club Stay Connected!!\n\nBisnis yang bisa dikerjakan dimana saja \nJoin bareng Komunitas kami yukkk !!!\n\nOriflame adalah sebuah perusahaan kecantikan terkemuka dengan sistem penjualan langsung. Hadir di lebih dari 60 negara, dan merupakan perusahaan yang berasal dari Swedia dengan kantor pusat di Swiss. Kami menawarkan produk kecantikan berkualitas tinggi - berikut kesempatan unik untuk bergabung menjadi konsultan kami dan memulai bisnis Anda sendiri. ', 'http://brightclub.biz', 1000000, 'logo-brightclub-biz.webp', 'brightclub-biz-1.webp', 'brightclub-biz-2.webp', 'brightclub-biz-3.webp', 'brightclub-biz-4.webp', 'brightclub-biz-5.webp', 'Sudah 2x saya pakai jasa Andri Sunardi untuk membuatkan website\nDan hasilnya sesuai dengan konsep yang diberikan.\nBahkan yang saya bingung, di bantu dengan hasil yang maksimal\nSukses terus, Develop Inspire Website', '', '2017-11-15', '2016-11-15 00:00:00', '', 1, 'brightclub-biz', '2016-11-13 20:00:00', '2020-11-07 15:03:42', NULL),
(39, 'PORTFOLIO000039', 11, 34, 'bary1623', 'DevelopInspireWebsite2016!', 1, 1, 'Barang Bekas Tungkal', 'Barang Bekas Tungkal adalah media situs website yang menyediakan bagi para penjual untuk menjual barang bekas dengan cara memasang iklan agar dapat terjual dengan cepat dan mudah sekaligus tempat mencari beragam produk barang bekas dan baru yang berkualitas bagi para pembeli.', 'https://www.barangbekastungkal.com', 2500000, 'logo-barang-bekas-tungkal.webp', 'barang-bekas-tungkal-1.webp', 'barang-bekas-tungkal-2.webp', 'barang-bekas-tungkal-3.webp', 'barang-bekas-tungkal-4.webp', 'barang-bekas-tungkal-5.webp', NULL, '', '2017-12-18', '2016-11-25 23:05:00', '', 1, 'barang-bekas-tungkal', '2016-11-24 19:05:00', '2020-11-07 15:03:42', NULL);
