(47, 'PORTFOLIO000047', 1, 52, '', '', 0, 1, 'Gereja Kristen Baithani Jemaat Aletheia', 'Gereja Kristen Baithani (GKB) Jemaat Aletheia adalah sebuah gereja  yang didirikan yang sejak 01 Juni 1996 yang beralamatkan di Perumahan Villa Tomang Baru Blok F 1 no. 1-3 A Kotabumi Pasar Kemis Tangerang, Banten dan berada dalam naungan Persekutuan Gereja-Gereja dan Lembaga-Lembaga Injili Indonesia (PGLII).\n\nPada mulanya GKB Jemaat Aletheia dimulai dengan sangat sederhana dalam sebuah bangunan rumah â€œ36â€ yang beralamatkan di Perumahan Villa Tomang Baru, Blok F11 no. 18 ini tak terlepas dari pergumulan panjang yang menggerakkan 10 orang untuk mengadakan pertemuan dan perencanaan hingga didirikannya gereja agar dapat membantu dan menfasilitasi para umat Kristiani yang tinggal di sekitar lingkungan agar dapat beribadah.\n\nKarena umat di GKB Jemaat Aletheia yang semakin bertambah sehingga bangunan gereja yang lama tidak cukup lagi menampung umat yang ada sampai akhirnya lewat proses yang panjang, maka didirikanlah sebuah bangunan baru di Blok F1 no. 1-3 dan untuk pertama kalinya gereja mengadakan kebaktian Natal pada tanggal 24 Desember 2015 di dalam gedung baru.', 'http://www.gkbaletheia.esy.es', 70000, 'logo-gereja-kristen-baithani-jemaat-aletheia.webp', 'gereja-kristen-baithani-jemaat-aletheia-1.webp', 'gereja-kristen-baithani-jemaat-aletheia-2.webp', 'gereja-kristen-baithani-jemaat-aletheia-3.webp', 'gereja-kristen-baithani-jemaat-aletheia-4.webp', 'gereja-kristen-baithani-jemaat-aletheia-5.webp', 'mksih bnyk yg gan...\n\nbtw tmen ane kn ntr pda skripsi. coba ane arahin ke ente. klo mau joki jokian ke ente', '', '2018-02-15', '2017-02-15 00:00:00', '', 1, 'gereja-kristen-baithani-jemaat-aletheia', '2017-02-13 20:00:00', '2020-11-07 15:03:42', NULL),
(48, 'PORTFOLIO000048', 1, 51, '', '', 0, 1, 'PT Sahassa Prima Niaga', 'Dengan diberlakukannya Undang-Undang No. 22 Tahun 2001, tentang Minyak dan Gas Bumi (MIGAS) oleh Pemerintah, maka setiap Badan Usaha atau Bentuk Usaha Tetap (BU/BUT), baik itu berupa koperasi maupun perusahaan swasta terbuka peluang dalam kegiatan usaha minyak dan gas bumi, baik itu kegiatan hulu maupun kegiatan hilir.\n\nKegiatan usaha minyak dan gas bumi sektor hilir terdiri atas kegiatan pengolahan, penyimpanan, pengangkutan dan niaga. PT. Sahassa Prima Niaga merupakan salah satu perusahaan swasta yang telah mengantongi Izin Usaha Niaga Umum Bahan Bakar Minyak dari Direktur Jenderal Minyak dan Gas Bumi Nomor 221.K/10.01/DJM.O/IU/2015 Tanggal 21 April 2015, melaksanakan kegiatan Usaha Niaga Umum Bahan Bakar Minyak. Adapun sarana dan fasilitas awal kegiatan Usaha Niaga Umum', '', 3000000, 'logo-pt-sahassa-prima-niaga.webp', 'pt-sahassa-prima-niaga-1.webp', 'pt-sahassa-prima-niaga-2.webp', 'pt-sahassa-prima-niaga-3.webp', 'pt-sahassa-prima-niaga-4.webp', 'pt-sahassa-prima-niaga-5.webp', '', '', NULL, '2017-02-17 20:57:00', '', 1, 'pt-sahassa-prima-niaga', '2017-02-16 16:57:00', '2020-11-07 15:03:42', NULL),
