(53, 'PORTFOLIO000053', 3, 55, 'toya8371', 'DevelopInspireWebsite2017!', 0, 1, 'Toko Multi Jaya', 'Sejarah Toko Multi Jaya\n\nToko Multi Jaya adalah usaha dagang yang telah berdiri sejak tahun 1994 dengan pendirinya (founder) adalah Bapak Tjan Kiat Tjoan yang sekaligus menjadi pemilik (owner) di Toko Multi Jaya.\n\nBersama dengan sang istri, Ibu Christina, beliau merintis usaha dagang ini berlokasi di Jalan Raya Proklamasi No. 12 Cimone Permai, Tangerang, Banten.\n\nToko Multi Jaya bergerak di bidang penjualan berbagai macam kebutuhan material dan sparepart peralatan elektronik rumah tangga, seperti Air Conditioner (AC) atau pendingin ruangan, kulkas, kipas angin, mesin cuci, serta menjual alat-alat teknik yang biasa digunakan oleh seorang teknisi.\n\nToko Multi Jaya telah dikenal baik oleh konsumen karena memberikan pelayanan yang terbaik dan harga yang kompetitif.\n\nVisi dan Misi\n\n1.	Visi\nMenjadi â€˜pilihan pertamaâ€™ sebagai penyedia sparepart peralatan elektronik rumah tangga.\n\n2.	Misi\nâ€¢	Menjual produk dengan jaminan mutu dan kualitas terbaik.\nâ€¢	Berkomitmen memberikan pelayanan terbaik untuk kepuasan pelanggan.\nâ€¢	Memberikan harga yang kompetitif.\nâ€¢	Meningkatkan nilai tambah dengan melayani keluhan dan memberikan informasi produk kepada pelanggan.\n\nLokasi Toko Multi Jaya\nâ€¢	Toko Multi Jaya\nâ€¢	Jalan Raya Proklamasi No. 12, Cimone Permai, Tangerang, Banten - Indonesia 15114.\nâ€¢	0816958507\nâ€¢	kurniawan.wendi95@gmail.com', 'https://www.tokomultijaya.com', 4500000, 'logo-toko-multi-jaya.webp', 'toko-multi-jaya-1.webp', 'toko-multi-jaya-2.webp', 'toko-multi-jaya-3.webp', 'toko-multi-jaya-4.webp', 'toko-multi-jaya-5.webp', 'Bagi anda yang butuh website untuk kegiatan bisnis, perusahaan, kegiatan sosial, promosi, atau keperluan lainnya, DIW hadir menjadi solusi terbaik untuk menjawab kebutuhan anda. Saya sudah membuktikan.', '', '2018-04-25', '2017-03-09 20:55:00', '', 1, 'toko-multi-jaya', '2017-03-08 16:55:00', '2020-11-07 15:03:42', NULL),
