(62, 'PORTFOLIO000062', 2, 62, 'sahr4389', 'QOmDA91p2LHrxNPViBU6', 1, 1, 'Sahabat Gadai', 'Sahabat Gadai adalah Perusahaan gadai yang didirikan tanggal 5 Desember 2015 dibawah naungan PT. Eka Pesona Abadi, sesuai dengan peraturan otoritas jasa keuangan No. 31/POJK.05/2016 tentang usaha pergadaian. Perkembangan perusahaan cukup pesat seiring dengan kebutuhan masyarakat untuk mencari solusi cepat dan mudah dalam rangka memnuhi kebutuhan keuangan mereka. Di dalam masa 6 bulan perusahaan telah memiliki 6 cabang yang menjangkau wilayah Cibubur, Gunung Putri, Jonggol, Bekasi, dan Cibinong.', 'https://www.sahabatgadai.com', 6073000, 'logo-sahabat-gadai.webp', 'sahabat-gadai-1.webp', 'sahabat-gadai-2.webp', 'sahabat-gadai-3.webp', 'sahabat-gadai-4.webp', 'sahabat-gadai-5.webp', '', '', '2019-04-18', '2017-04-18 11:45:00', '', 1, 'sahabat-gadai', '2017-04-17 07:45:00', '2020-11-07 15:03:42', NULL),
