(67, 'PORTFOLIO000067', 1, 69, '', '', 1, 1, 'Putra Mekar', 'Kami Percetakan CV PUTRA MEKAR (Creative Design - Printing - Advertising - Sablon)\n\nPada kesempatan ini perkenalkan kami PUTRA MEKAR adalah perusahaan yang bergerak dibidang jasa percetakan, ingin menawarkan kerjasama dalam pemenuhan kebutuhan percetakan perusahaan/usaha anda. Kami sangat terbuka untuk berkonfirmasi dan memberikan keterangan sesuai dengan kebutuhan percetakan perusahaan anda.\n\nBerikut ini kami tawarkan beberapa jenis penawaran yang kami sediakan untuk anda, seperti:\n\nNOTA, FAKTUR, KOP SURAT, AMPLOP, KARTU NAMA, SPANDUK, BALEHO, STICKER, BROSUR, X-BANNER, ROLL- UP BANNER, MINI BANNER, POSTER, MAP, KWITANSI, KALENDER, UNDANGAN, YASIN, ID CARD, NEON BOX, SERTIFIKAT, BUKU TAHUNAN, KARTU NAMA, KEMASAN MAKANAN, LABEL PRODUK, STEMPEL DLL.', '', 2000000, 'logo-putra-mekar.webp', 'putra-mekar-1.webp', 'putra-mekar-2.webp', 'putra-mekar-3.webp', 'putra-mekar-4.webp', 'putra-mekar-5.webp', '', '', NULL, '2017-05-28 00:00:00', '', 1, 'putra-mekar', '2017-05-26 20:00:00', '2020-11-07 15:03:42', NULL),
