(69, 'PORTFOLIO000069', 3, 41, 'aniescol', '4yw4Qo1I7a', 1, 1, 'Anies Collection', 'Part time tailor and cook - full time mother.\n\nI enjoy sewing and knitting very much so - that I made career out of it. Starting out as taking sewing classes while raising my children, and taking few orders from neighbours. After that, I start working with a company that make traditional malay clothes in bulk which help me learn how to cut and sew in a faster way.\n\nExperienced more than 20 years of tailoring different kind of design such as;\n\n- Baju Kurung\n- Baju Kurung Modem\n- Baju Kurung Pahang\n- Baju Kebaya\n- Jubah\n- Baju Melayu\n\nBring your own fabric and material to me and we\'ll start working on your baju right away!', 'http://www.anies-collection.com', 1500000, 'logo-anies-collection.webp', 'anies-collection-1.webp', 'anies-collection-2.webp', 'anies-collection-3.webp', 'anies-collection-4.webp', 'anies-collection-5.webp', '', '', '2018-08-11', '2017-08-11 11:08:00', '', 1, 'anies-collection', '2017-08-10 07:08:00', '2020-11-07 15:03:42', NULL),
(70, 'PORTFOLIO000070', 12, 73, 'gend2962', 'DIW.CO.ID-DevelopInspireWebsite2017!', 1, 1, 'Genius One', 'Genius One adalah sebuah perusahaan swasta yang bergerak di bidang bimbingan belajar private bertempat di gading serpong.\n\nPerusahaan ini pertama kali berdiri pada tahun 2011 dengan nama lama legacy private.\n\nPerusahaan kami bermotto \"Kepintaran dan nilai bagus murid adalah kewajiban kami\".\n\nKami menyediakan jasa private bagi semua murid di daerah tangerang dan jakarta, dengan guru-guru yang berpengalaman dan kompeten pastinya, kami telah banyak membantu murid-murid nasional plus ataupun international untuk menghadapi ujian - ujian maupun project - project.\n\n\"Kalau bisa pintar bersama kami, kenapa harus menunggu besok ?\"', 'https://www.geniusone.id', 2000000, 'logo-genius-one.webp', 'genius-one-1.webp', 'genius-one-2.webp', 'genius-one-3.webp', 'genius-one-4.webp', 'genius-one-5.webp', '', '', '2018-08-25', '2017-08-24 18:56:00', '', 1, 'genius-one', '2017-08-23 14:56:00', '2020-11-07 15:03:42', NULL),
(71, 'PORTFOLIO000071', 12, 74, 'ourq6548', 'DzrQfJQZWK1p54', 1, 1, 'Our Teacher', 'OurTeacher ini berdiri melalui Entrepreneurship di Binus Alam Sutera dan di dirikan oleh 2 orang, yaitu Yohanes Christian Sukmawijaya dan Kevin Er Aldo Ukla Basti. Kami ingin para siswa/i akan dengan mudah mendapatkan guru les privat mereka melalui website kami dengan pencarian terdekat. Pusat kami untuk sekarang ini berada di Kampus Binus Alam Sutera Main Campus, Jl. Jalur Sutera Barat Kav.21, Alam Sutera.', 'https://www.ourteacher.net', 1500000, 'logo-our-teacher.webp', 'our-teacher-1.webp', 'our-teacher-2.webp', 'our-teacher-3.webp', 'our-teacher-4.webp', 'our-teacher-5.webp', 'Manteb ko, walaupun anak kampus bs dpt hasil yg bgs bngt menurut saya, pengerjaan jg cpet bngt, the best ko 👍 👍&nbsp;', '', '2018-08-28', '2017-08-28 12:13:00', '', 1, 'our-teacher', '2017-08-27 08:13:00', '2020-11-07 15:03:42', NULL),
(72, 'PORTFOLIO000072', 11, 75, 'manw7257', 'Developinspirewebsite2017!', 1, 1, 'Manjakani Manza', 'Manjakani Manza adalah herbal 100% alami yang efektif mengencangkan dinding vagina, peningkat libido bagi wanita, pelumasan, dan membersihkan area Vagina secara alami.\n\nManfaat Manza\nMengencangkan Vagina\nManza bekerja dengan memberi tubuh anda apa yang dimilikinya sebelum menggunakan fitoestrogen(estrogen herbal), yang dengan mudah memperkuat otot dinding vagina Anda.\n\nMengembalikan Pelumasan dan Libido\nFormula Manza juga mengembalikan lapisan vagina bagian dalam yang bertanggung jawab atas pelumasan, memberikan nafsu seksual yang sehat.\n\nPembersihan Vagina\nBahan ramuan Manza mengandung zat anti oksidan dan antibakteri tingkat tinggi sehingga menjadi pembersih yang kuat!\n\nMeringankan Menopause\nMembantu menyeimbangkan tingkat estrogen, meringankan perubahan suasana hati, dan sulit tidur di malam hari.\n\n100% Herbal Alami\nTidak Ada Efek Samping\nBPOM Approves\nMUI Approves\nBest Seller\n\nBagaimana Cara Kerja Manza\nFitoestrogen (tanaman estrogen) membantu menciptakan sel baru untuk memperkuat otot dinding vagina.', 'https://www.manzaherbs.com', 3000000, 'logo-manjakani-manza.webp', 'manjakani-manza-1.webp', 'manjakani-manza-2.webp', 'manjakani-manza-3.webp', 'manjakani-manza-4.webp', 'manjakani-manza-5.webp', 'Good SERVICES n FRIENDLY', '', '2019-09-05', '2017-08-31 20:51:00', '', 1, 'manjakani-manza', '2017-08-30 16:51:00', '2020-11-07 15:03:42', NULL),
(73, 'PORTFOLIO000073', 3, 38, 'indm9217', 'Indonut2017!', 1, 1, 'Kangaroo', 'PT Surya Lestari Gemilang pertama berdiri tahun 1990 beralamat di Kota Batam, yang merupakan bagian dari Group Perusahaan &quot;SLG Group&quot; yang berkantor pusat di Singapura. Seiring berjalannya waktu, PT. Surya Lestari Gemilang mulai berkembang dan membuka kantor cabang di Kota Tangerang Selatan, Banten pada tahun 1998. Selain di Indonesia, SLG group juga memiliki kantor di Malaysia, Thailand dan Filipina. SLG Group memiliki Visi menjadi trend setter dalam industri makanan ringan dan Misi dari SLG Group adalah memberikan pengalaman &quot;ngemil&quot; yang tak terlupakan.<br><br>Didirikan oleh almarhum Tuan Ng Sun Lim dan putranya, yang saat ini menjadi Chief Executive Officer, Mr Michael Ng. Perusahaan ini telah mengalami revolusi dari model pengolahan tradisional menjadi sitem pengolahan yang modern untuk menghasilkan produk makanan yang berkualitas dan telah menerapkan standarisasi industri yang tinggi. Saat ini manufaktur SLG Group memiliki fasilitas produksi khusus seluas 20.000 meter persegi.<br><br>Selama lebih dari seperempat abad, perusahaan yang sekarang dikenal dengan &quot;SLG Group&quot;, menjadi spesialis dalam memproses, mengemas dan memasarkan beragam makanan ringan premium, termasuk kacang-kacangan, buah kering dan kerupuk. Sejalan dengan filosofi kualitas dan inovasi ini, CEO kami saat ini, Michael Ng telah membangun kembali merek andalan perusahaan kami yaitu &quot;Kangaroo&quot; menjadi trend setter untuk kategori makanan ringan.&nbsp;', 'https://www.indonut.co.id', 4440000, 'logo-kangaroo.webp', 'kangaroo-1.webp', 'kangaroo-2.webp', 'kangaroo-3.webp', 'kangaroo-4.webp', 'kangaroo-5.webp', 'Thank you so much buat diw dalam pengerjaan website kangaroonya...webnya sesuai dengan apa yang diminta ga nyesel custom web di diw &eth;&Yuml;&tilde;&Scaron; buat nextnya pasti bikin di diw lg 👍 👍 👍&nbsp;', '', '2019-10-07', '2017-08-31 16:56:00', '', 1, 'kangaroo', '2017-08-30 12:56:00', '2020-11-07 15:03:42', NULL),
