(80, 'PORTFOLIO000080', 11, 82, 'diec3486', 'DietAlami.id2017!', 1, 1, 'Diet Alami', 'Diet Alami adalah cara menurunkan berat badan aman dan cepat, turunkan berat badan secara alami tanpa diet dan lapar, sehat menguruskan badan yang gemuk.', 'https://www.dietalami.id', 3250000, 'logo-diet-alami.webp', 'diet-alami-1.webp', 'diet-alami-2.webp', 'diet-alami-3.webp', 'diet-alami-4.webp', 'diet-alami-5.webp', '', '', '2018-10-11', '2017-10-11 12:08:00', '', 1, 'diet-alami', '2017-10-10 08:08:00', '2020-11-07 15:03:42', NULL),
(81, 'PORTFOLIO000081', 1, 83, 'dinx1753', 'rXT3ydGm91yK32', 1, 1, 'PT Dinamika Unggul Perkasa', 'Sejarah Lebih baik - pengalaman DUP merupakan pelopor dalam sistem window U-PVC di Indonesia dan telah berdiri sejak 1996. Di bawah merek FEGA dan FESIA, kami memproduksi jendela dan pintu U-PVC untuk apartemen pribadi, apartemen mewah dan hotel bintang lima. 2009 Massa pertama menghasilkan jendela PVC-U untuk pasar menengah-atas dengan merek &quot;FESIA&quot;. 1996 Pendiri perusahaan DUP di Tangerang dan massa pertama diproduksi PVC-U windows dengan merek &quot;FEGA&quot; untuk pasar high end. Visi Kami adalah pemimpin di industri jendela U-PVC, yang memberikan nilai terbaik untuk layanan dan kualitas produk terbaik bagi pelanggan kami sekaligus menghasilkan tingkat pengembalian aset yang tinggi bagi para pemegang saham kami. Misi Kami adalah perusahaan yang sukses, yang mendukung industri konstruksi melalui produk dan layanan yang bermanfaat bagi umat manusia. Tujuan Pembuat kaca terbaik di dunia.', 'https://www.dinamikaunggulperkasa.com', 2100000, 'logo-pt-dinamika-unggul-perkasa.webp', 'pt-dinamika-unggul-perkasa-1.webp', 'pt-dinamika-unggul-perkasa-2.webp', 'pt-dinamika-unggul-perkasa-3.webp', 'pt-dinamika-unggul-perkasa-4.webp', 'pt-dinamika-unggul-perkasa-5.webp', 'Terima kasih yah koh atas bantuan nya selama KP dan Skripsi 🙏 nnti klo ada yg mw bkin website, saya rekomendasikan skalian 👍 &nbsp;Thank you yah koh', '', '2019-06-28', '2017-09-17 23:17:00', '', 1, 'pt-dinamika-unggul-perkasa', '2017-09-16 19:17:00', '2020-11-07 15:03:42', NULL);
