(88, 'PORTFOLIO000088', 1, 132, '', '', 0, 1, 'Suku Baduy', 'Apa Itu Suku Baduy ?\nUrang Kanekes, Orang Kanekes atau Orang Baduy atau Badui merupakan kelompok masyarakat adat sub-etnis Sunda di wilayah Kabupaten Lebak, Banten. Populasi mereka sekitar 11.000 orang, dan mereka merupakan salah satu suku yang mengisolasi diri mereka dari dunia luar.', '', 1500000, 'logo-suku-baduy.webp', 'suku-baduy-1.webp', 'suku-baduy-2.webp', 'suku-baduy-3.webp', 'suku-baduy-4.webp', 'suku-baduy-5.webp', '', '', NULL, '2017-12-04 11:00:00', '', 1, 'suku-baduy', '2017-12-03 07:00:00', '2020-11-07 15:03:43', NULL),
(89, 'PORTFOLIO000089', 1, 134, '', '', 0, 1, 'Wisata Alam', 'Website Wisata Alam merupakan website yang mengelolah isi wisata alam yang ada di kabupaten lebak, banten yang bertujuan untuk menginformasikan apa saja tujuan, biaya, dan budaya yang ada.\n\nMENURUT SK. MENPARPOSTEL NO.: KM. 98 / PW.102 / MPPT-87\nObjek Wisata adalah semua tempat atau keadaan alam yang memiliki sumber daya wisata yang dibangun dan dikembangkan sehingga mempunyai daya tarik dan diusahakan sebagai tempat yang dikunjungi wisatawan.\n\nTujuan dari wisata alam:\n- Meningkatkan pertumbuhan ekonomi\n- Meningkatkan rasa cinta tanah air\n- Meningkatkan kesejahteraan bangsa', '', 1500000, 'logo-wisata-alam.webp', 'wisata-alam-1.webp', 'wisata-alam-2.webp', 'wisata-alam-3.webp', 'wisata-alam-4.webp', 'wisata-alam-5.webp', '', '', NULL, '2017-12-05 17:33:00', '', 1, 'wisata-alam', '2017-12-04 13:33:00', '2020-11-07 15:03:43', NULL),
(90, 'PORTFOLIO000090', 1, 65, '', '', 0, 1, 'Bangunan Bersejarah', 'Situs ini merupakan salah satu upaya untuk memperkenalkan bangunan bersejarah kota serang kepada masyarakat.\n\nSitus ini berisikan informasi tentang bangunan bersejarah kota serang dimulai dari foto, event, deskripsi lengkap, dan video.', '', 1500000, 'logo-bangunan-bersejarah.webp', 'bangunan-bersejarah-1.webp', 'bangunan-bersejarah-2.webp', 'bangunan-bersejarah-3.webp', 'bangunan-bersejarah-4.webp', 'bangunan-bersejarah-5.webp', '', '', NULL, '2017-12-05 19:31:00', '', 1, 'bangunan-bersejarah', '2017-12-04 15:31:00', '2020-11-07 15:03:43', NULL),
(91, 'PORTFOLIO000091', 1, 135, '', '', 0, 1, 'Cagar Budaya', 'DEFINISI\nCagar Budaya dapat diketahui bahwa cagar budaya didefinisikan sebagai kekayaan budaya bangsa sebagai wujud pemikiran dan perilaku kehidupan manusia yang penting artinya bagi pemahaman dan pengembangan sejarah, ilmu pengetahuan, dan kebudayaan dalam kehidupan bermasyarakat, berbangsa, dan bernegara sehingga perlu dilestarikan dan dikelola secara tepat melalui upaya pelindungan, pengembangan, dan pemanfaatan dalam rangka memajukan kebudayaan nasional untuk sebesar-besarnya kemakmuran rakyat.\n\nKATEGORI CAGAR BUDAYA\nCagar budaya sendiri dapat berupa:\n- Benda\n- Bangunan\n- Struktur\n- Situs\n- Kawasan\n\nKRITERIA CAGAR BUDAYA\nAdapun kriteria yang harus dipenuhi dalam penetapan cagar budaya adalah:\n- Berusia 50 tahun atau lebih\n- Mewakili masa gaya paling singkat berusia 50 tahun\n- Memiliki arti khusus bagi sejarah, ilmu pengetahuan, pendidikan, agama, dan/atau kebudayaan\n- Memiliki nilai budaya bagi penguatan kepribadian bangsa\n\nPada setiap objek wisata yang didaftarkan sebagai cagar budaya akan di verifikasi oleh Dinas Pemerintah Daerah terkait dan selanjutnya akan dikaji oleh Tim Ahli. Jika hasil kajian menyatakan objek tersebut merupakan objek cagar budaya, maka akan ditetapkan dengan Surat Keputusan(SK) Penetapan Cagar Budaya dan mendapatkan Nomor Registrasi Nasional dari objek yang didaftarkan.\n\nInformasi mengenai cagar budaya secara lebih detail dapat dilihat pada Undang-Undang Nomor 11 Tahun 2010 tentang Cagar Budaya.', '', 1500000, 'logo-cagar-budaya.webp', 'cagar-budaya-1.webp', 'cagar-budaya-2.webp', 'cagar-budaya-3.webp', 'cagar-budaya-4.webp', 'cagar-budaya-5.webp', '', '', NULL, '2017-12-08 08:43:00', '', 1, 'cagar-budaya', '2017-12-07 04:43:00', '2020-11-07 15:03:43', NULL),
