(101, 'PORTFOLIO000101', 16, 148, 'inajobs', 'In@J0bs0718', 1, 2, 'In A Jobs', 'InaJobs adalah layanan karir online yang diperuntukkan bagi Perusahaan dan Pencari kerja guna mempertemukan aspek psikologis dari suatu pekerjaan dengan karekteristik yang dimiliki calon karyawan. Melalui InaJobs kita bisa mengetahui aspek psikologis apa yang dibutuhkan oleh suatu pekerjaan tertentu ( Misal pekerjaan Staff Akuntansi membutuhkan adanya Ketekunan, Ketelitian, Menyukai kerja rutin dll ), untuk kemudian dicocokkan dengan karakteristik dari calon karyawan apakah sesuai atau tidak. InaJobs menggunakan konsep DISC dari Dr. William Moulton Marston. Dalam bukunya yang berjudul The Emotions of Normal People , Marston membagi 4 tipe perilaku individu ketika berinteraksi dengan lingkungannya, yakni Dominance, Influence, Steadiness dan Compliance. Para ahli sudah mengembangkan test DISC untuk mengukur aspek-aspek tersebut, dengan versi yang berbeda-beda tegantung dari yang mengembangkannya.', 'https://www.inajobs.com', 5400000, 'logo-in-a-jobs.webp', 'in-a-jobs-1.webp', 'in-a-jobs-2.webp', 'in-a-jobs-3.webp', 'in-a-jobs-4.webp', 'in-a-jobs-5.webp', 'Acung jempol buat kerja kerasnya menyelesaikan project. Saya akan gunakan freelencer ini untuk pekerjaan berikutnya.', 'https://www.sribulancer.com/id/users/andrisunardi', '2021-08-04', '2018-03-17 09:45:00', '- Rp. 600.000 From Sribulancer (Rp6.000.000)', 1, 'in-a-jobs', '2018-03-16 05:45:00', '2020-11-07 15:03:43', NULL),
(102, 'PORTFOLIO000102', 2, 149, 'shog7619', 'ebJCGFXyUIwfR8Qvqk7i', 1, 1, 'Shoes Clean', 'Shoes Clean merupakan Jasa perawatan Premium sepatu pertama di makassar dan di indonesia bagian timur Untuk melayani pelanggan, saat ini kami memiliki workshop 9 di 6 kota. Berdiri di Makassar, Shoes clean Mulai memberikan perawatan sepatu sejak 08 Desember 2014. Dalam membuat usaha Shoes clean melahirkan akun media sosial dan melayani sepatu secara online, sejak saat itu sampai saat ini. Lebih dari 300.000 pasang sepatu yang telah kami tangani. Shoes Clean melakukan perawatan sepatu secara profesional, dengan teknik khusus, serta menggunakan alat dan bahan premium untuk perawatan sepatu, baik produk lokal maupun luar negeri. Selain melayani perawatan sepatu, Shoes Clean paham bahwa edukasi sangatlah penting untuk meningkatkan kesadaran masyarakat. Maka dari itulah, Shoes Clean selalu memberikan tips-tips perawatan sepatu dan konsultasi gratis. Shoes Clean juga sering diundang dalam berbagai acara untuk memberikan tips dan workshop mengenai perawatan sepatu. Kini, Shoes Clean tidak hanya menangani sepatu, tetapi juga tas, topi, dan dompet. Menu yang ditawarkan pun makin beragam, mulai cleaning, repaint, dan repair. Beberapa achievement Shoes Clean antara lain: Talk Show di radio, diantaranya Iradio,Bradio,Delta FM Diliput oleh berbagai media, baik media cetak, elektrik, dan online, diantaranya adalah tribun timur makassar, koran sulsel, fajar online , koran fajar, bisnis sulawesi, MNC Group ( MNC TV, RCTI, Global TV ), NET TV, Kompas TV, Metro TV , ANTV, Indosiar, SCTV dan TVRI', 'https://www.shoes-clean.com', 2950000, 'logo-shoes-clean.webp', 'shoes-clean-1.webp', 'shoes-clean-2.webp', 'shoes-clean-3.webp', 'shoes-clean-4.webp', 'shoes-clean-5.webp', 'Terima kasih agan andri sunardi berkat jasa website diw.co.id company profil usaha saya sudah jadi dan hasilnya mantap ! Dan tidak pernah mengeluh walaupun direvisi sampai berkali-kali.... Recomended banget lah ! Nanti kalau ada