(139, 'PORTFOLIO000139', 2, 265, 'k6563323', 'Mis.com2019!', 1, 1, 'PT Mitra Integrasi Solusi', '<strong>Trust Speed Reliable Connect</strong><br><br>We as your consultant to give the right IT Solutions with proper investments, bridging gaps, supported by world-class brands.<br><br>Become a trusted partner is our philosophy<br>Our business objective is assist customer to apply right information technology solutions in their organization to achieve business goals by providing the proper solution and cost effective, good service, reliable, and continious support to the IT Investment and possible to develop in the future.<br><br><strong>Company</strong><br>We provide &quot;End to End Solution&quot; in IT Infrastructure and ensuring &quot;Bridging Your IT Gap&quot;.<br><br><strong>Vision</strong><br>Bridging technology to business.<br><br><strong>Mission</strong><br>Provide technology that work now and future.', '//www.mitraintegrasisolusi.com', 3000000, 'logo-pt-mitra-integrasi-solusi.webp', 'pt-mitra-integrasi-solusi-1.webp', 'pt-mitra-integrasi-solusi-2.webp', 'pt-mitra-integrasi-solusi-3.webp', 'pt-mitra-integrasi-solusi-4.webp', 'pt-mitra-integrasi-solusi-5.webp', NULL, NULL, '2022-07-09', '2019-09-20 19:00:00', NULL, 1, 'pt-mitra-integrasi-solusi', '2019-09-23 02:33:21', '2022-04-29 11:49:12', NULL),
(140, 'PORTFOLIO000140', 17, 267, 'thet9674', '3tUuPxLA9jMeNETmXBQk', 1, 1, 'The Altitude Apartment South Gate', '<strong>The Altitude @ SouthGate<br>Life Simply &ndash; Dream Big &ndash; Discover Joy - Developer By Sinarmas Land</strong><br><br>The Altitude Apartment South Gate merupakan tower terbaru dari Superblock Southgate Apartement, dibangun oleh developer berpengalaman yaitu Sinar Mas Land yang berdiri di luas lahan 5,4 Ha (Hektar) yang akan menjadi icon baru kawasan ini dan akan menjadi pendorong kemajuan kawasan sekitarnya agar lebih tertata dan lebih modern. Ditujukan untuk Eksekutif Muda &amp; Pengusaha Muda yang masih menawarkan dengan harga perdana, sehingga sangat menguntungkan buat para investor.<br><br>The Altitude Apartment South Gate berlokasi di kawasan TB Simatupang Jakarta Selatan tepatnya Di Jln Tanjung barat No. 163 dan terintegrasi dengan AEON Mall Jakarta Selatan, berada di lokasi yang menawarkan kemudahan akses, pilihan, dan kesenangan bagi para profesional maupun wirausahawan yang mencari gaya hidup efisien sehingga penghuni dapat menikmati lingkungan yang lebih hidup dibanding di tempat lain dan terintengrasi yang mana semua kebutuhan ada didalam satu area kawasan yang terdiri dari Apartment, Office Tower, Hotel, Mall (Mixed Used Development), dan berada di sebrang stasiun memudahkan anda untuk bermobilitas agar dapat melengkapi perkembangan area ini menjadi pusat bisnis baru (CBD) di Jakarta.', 'https://www.thealtitudeapartment-southgate.com', 1000000, 'logo-the-altitude-apartment-south-gate.webp', 'the-altitude-apartment-south-gate-1.webp', 'the-altitude-apartment-south-gate-2.webp', 'the-altitude-apartment-south-gate-3.webp', 'the-altitude-apartment-south-gate-4.webp', 'the-altitude-apartment-south-gate-5.webp', NULL, NULL, '2019-09-25', '2019-09-25 11:04:12', NULL, 1, 'the-altitude-apartment-south-gate', '2019-09-24 14:59:43', '2020-11-07 15:03:43', NULL),
(141, 'PORTFOLIO000141', 3, 80, 'csps', 'T19araksaship86', 1, 1, 'Central SPS', 'CENTRAL SPS, merupakan salah satu perusahaan Screen Printing Terbesar di Indonesia yang saat ini hampir memasuki usia 5 dasawarsa. Berdiri sejak tahun 1974 dengan kantor pusat di Jakarta dan telah memiliki berbagai cabang yang tersebar di seluruh wilayah Indonesia', '//www.centralsps.co.id', 5000000, 'logo-central-sps.webp', 'central-sps-1.webp', 'central-sps-2.webp', 'central-sps-3.webp', 'central-sps-4.webp', 'central-sps-5.webp', NULL, NULL, '2022-09-18', '2019-10-02 20:26:00', 'Real From Ronaldi : Rp. 15.000.000', 1, 'central-sps', '2019-10-04 10:20:49', '2022-04-29 11:12:58', NULL),
