(150, 'PORTFOLIO000150', 17, 267, 'alth4263', 'nk3KqeaDQFwb74', 1, 1, 'Altuera South Gate', '<strong>The Altitude @ SouthGate<br>Life Simply &ndash; Dream Big &ndash; Discover Joy - Developer By Sinarmas Land</strong><br><br>The Altitude Apartment South Gate merupakan tower terbaru dari Superblock Southgate Apartement, dibangun oleh developer berpengalaman yaitu Sinar Mas Land yang berdiri di luas lahan 5,4 Ha (Hektar) yang akan menjadi icon baru kawasan ini dan akan menjadi pendorong kemajuan kawasan sekitarnya agar lebih tertata dan lebih modern. Ditujukan untuk Eksekutif Muda &amp; Pengusaha Muda yang masih menawarkan dengan harga perdana, sehingga sangat menguntungkan buat para investor.<br><br>The Altitude Apartment South Gate berlokasi di kawasan TB Simatupang Jakarta Selatan tepatnya Di Jln Tanjung barat No. 163 dan terintegrasi dengan AEON Mall Jakarta Selatan, berada di lokasi yang menawarkan kemudahan akses, pilihan, dan kesenangan bagi para profesional maupun wirausahawan yang mencari gaya hidup efisien sehingga penghuni dapat menikmati lingkungan yang lebih hidup dibanding di tempat lain dan terintengrasi yang mana semua kebutuhan ada didalam satu area kawasan yang terdiri dari Apartment, Office Tower, Hotel, Mall (Mixed Used Development), dan berada di sebrang stasiun memudahkan anda untuk bermobilitas agar dapat melengkapi perkembangan area ini menjadi pusat bisnis baru (CBD) di Jakarta.', 'https://www.altuerasouthgate.com', 750000, 'logo-altuera-south-gate.webp', 'altuera-south-gate-1.webp', 'altuera-south-gate-2.webp', 'altuera-south-gate-3.webp', 'altuera-south-gate-4.webp', 'altuera-south-gate-5.webp', NULL, NULL, '2022-01-16', '2020-01-16 15:11:45', NULL, 1, 'altuera-south-gate', '2020-01-16 08:59:07', '2021-01-23 18:01:03', NULL),
