(164, 'PORTFOLIO000164', 2, 290, 'jjpindolaw', 'JJPlaw:1812', 1, 1, 'Januar Jahja Partners', 'Januar Jahja & Partners (JJP)While Indonesian trademark law is generally harmonized with international norms, Indonesia’s trademark system has many of its own unique aspects and particulars that may not be familiar to non-Indonesian counsel. Successfully navigating these potential hurdles requires experienced local counsel who are familiar with both the relevant regulations and the day-to-day practice of Indonesian trademark law. Januar Jahja & Partners has over 25 years of experience working with both clients and the Indonesian Trademark Office to register, renew and protect trademarks registered in Indonesia. Through this experience, Januar Jahja & Partners has built up its trademark portfolio to include leading international companies in such fields as apparel, IT, design, and travel, as well as numerous well-known Indonesian companies.As part of our trademark practice, we are able to handle all non-contentious trademark prosecution matters such as preliminary searches, trademark applications, recordals of name change or address change, recordals of assignment, trademark renewals, and responding to office actions, in addition to providing pre-filing advice and counseling.Additionally, Januar Jahja & Partners is particularly experienced in handling the more substantive aspects of trademark law, such as oppositions to trademark applications, objections to trademark application rejections and more contentious trademark matters, such as cancellation proceedings based on non-use or bad faith before the Jakarta Commercial Court and trademark infringement actions.Pursuant to Indonesian Trademark Law No. 15/2001, in order to file a trademark application in Indonesia, the minimum requirements are:Full name and address of applicant;Nationality (for natural person) or detail of incorporation (for legal entity);A representation of the mark and its transliteration (if any);List of goods and/or services and the classes pertaining thereto;A certified copy of home country application (for claiming priority);A signed Power of Attorney; andA signed Statement of Entitlement.Please contact us if you would like to receive our Schedule of Charges for Trademark matters or would like to receive the Power of Attorney and Statement of Entitlement forms so that you can begin the process of protecting your trademark in Indonesia.', '//www.jahja.com', 3000000, 'logo-januar-jahja-partners.webp', 'januar-jahja-partners-1.webp', 'januar-jahja-partners-2.webp', 'januar-jahja-partners-3.webp', 'januar-jahja-partners-4.webp', 'januar-jahja-partners-5.webp', NULL, NULL, '2022-07-28', '2020-08-26 18:56:51', NULL, 1, 'januar-jahja-partners', '2021-01-20 16:52:58', '2022-04-29 11:27:55', NULL),
