(189, 'PORTFOLIO000189', 2, 408, 'mdvcoid1', '1r2*kaCMXfX14*', 1, 1, 'PT MDV Indonesia', '<div><span style=\"font-size: 13.2px;\">PT MDV Indonesia is an Importer in Indonesia, We provide complete trade details of Importers like Product, Price, Quantity, HS code, Ports and suppliers.</span></div><div><span style=\"font-size: 13.2px;\"><br></span></div><div><span style=\"font-size: 13.2px;\">Perusahaan Sispo Kontruksi</span></div><div><span style=\"font-size: 13.2px;\">Didirikan sejak tahun 2009 dan sangat berpengalaman di bidang HVAC dengan pengalaman pendiri lebih dari 40 tahun.</span></div><div><span style=\"font-size: 13.2px;\">Visi kami adalah menjadi pemimpin dalam distribusi produk yang terintegrasi dengan pelayanan purna jual terbaik.</span></div><div><span style=\"font-size: 13.2px;\">Misi kami adalah menyediakan udara yang sehat dan bersih dengan sistem tata udara yang berkualitas.</span></div><div><span style=\"font-size: 13.2px;\">Produk yang kami jual adalah :</span></div><div><span style=\"font-size: 13.2px;\">1. Air Conditioner Merk Fuji Ac</span></div><div><span style=\"font-size: 13.2px;\">2. Sandwich Panel Merk Subzero</span></div><div><span style=\"font-size: 13.2px;\">3. The Insulation Expert Merk Versa Foam</span></div>', '//www.mdv.co.id', 15000000, 'logo-pt-mdv-indonesia.webp', 'pt-mdv-indonesia-1.webp', 'pt-mdv-indonesia-2.webp', 'pt-mdv-indonesia-3.webp', 'pt-mdv-indonesia-4.webp', 'pt-mdv-indonesia-5.webp', NULL, NULL, '2023-01-14', '2021-08-12 11:38:54', NULL, 1, 'pt-mdv-indonesia', '2021-08-12 04:40:55', '2022-01-16 09:54:44', NULL);
