(190, 'PORTFOLIO000190', 17, 274, 'rumahbi2', '92X6](sCFe8tCz', 1, 1, 'Rumah Bintaro Paradiso', '<p><span style=\"color: rgb(117, 117, 117); font-family: Raleway, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); --darkreader-inline-color:#9e9689; --darkreader-inline-bgcolor:#181a1b;\" data-darkreader-inline-color=\"\" data-darkreader-inline-bgcolor=\"\">Hunian sempurna dengan gaya modern minimalis di jantung kawasan Bintaro. Bintaro Paradiso menawarkan kenyamanan, keamanan, dan lingkungan asri untuk Anda dan keluarga. Raihlah kemudahan hidup dengan hunian yang dikelilingi fasilitas pendidikan, pusat perbelanjaan, rumah sakit, dan pusat kuliner.</span><br style=\"color: rgb(117, 117, 117); font-family: Raleway, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); --darkreader-inline-color:#9e9689; --darkreader-inline-bgcolor:#181a1b;\" data-darkreader-inline-color=\"\" data-darkreader-inline-bgcolor=\"\"><span style=\"color: rgb(117, 117, 117); font-family: Raleway, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); --darkreader-inline-color:#9e9689; --darkreader-inline-bgcolor:#181a1b;\" data-darkreader-inline-color=\"\" data-darkreader-inline-bgcolor=\"\">Tinggal nyaman di daerah hunian paling strategis di Jakarta Selatan, bisa banget! Bintaro dari dulu memang sudah terkenal sebagai salah satu daerah hunian elit dan nyaman buat sebagian masyarakat Jakarta Selatan dan Tangerang Selatan. Akses yang mudah menuju pusat kota dan lengkap dengan berbagai destinasi hiburan, restoran dan kafe, membuat Bintaro jadi daerah yang sangat strategis.</span><br></p>', '//www.rumahbintaroparadiso.com', 2300000, 'logo-rumah-bintaro-paradiso.webp', 'rumah-bintaro-paradiso-1.webp', 'rumah-bintaro-paradiso-2.webp', 'rumah-bintaro-paradiso-3.webp', 'rumah-bintaro-paradiso-4.webp', 'rumah-bintaro-paradiso-5.webp', NULL, NULL, '2022-09-29', '2021-09-22 16:23:13', NULL, 1, 'rumah-bintaro-paradiso', '2021-09-23 07:56:33', '2021-10-02 04:25:57',