(194, 'PORTFOLIO000194', 19, 285, 'u3197666', 'Worldharvest2020!', 0, 0, 'World Harvest System', 'World Harvest adalah organisasi kemanusiaan yang berfokus untuk memberikan dampak melalui tiga pilar yaitu: Komunitas, Pendidikan dan Layanan Media. World Harvest didirikan pada tahun 1989 dengan tujuan untuk menjangkau dan membantu orang-orang didaerah terpencil ataupun tertinggal.', '//www.worldharvest.id', 10000000, 'logo-world-harvest.webp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-02-08', '2021-11-15 13:21:39', NULL, 1, 'world-harvest-system', '2021-11-15 12:19:23', '2022-04-29 10:24:24', NULL),
