(200, 'PORTFOLIO000200', 12, 285, 'u9758543', 'Hits2022', 1, 1, 'HITS', '<div>Sekolah Tinggi Teologi Internasional Harvest (STTIH) atau disebut juga Harvest International Theological Seminary merupakan bentuk Sekolah Tinggi yang mengemban tugas dan fungsi perguruan tinggi dalam upaya mencerdaskan kehidupan bangsa, khususnya dalam pendidikan Teologi yang mengacu pada Undang-Undang Nomor 2 Tahun 1989 dan Peraturan Pemerintah No. 30 Tahun 1990 tentang penyelenggaraan pendidikan tinggi teologi.</div><div><br></div><div>HITS didirikan pada tanggal 05 Oktober 1998 oleh Dr. Jimmy Oentoro, merupakan sekolah tinggi teologi yang berada dalam pembinaan dan pengolaan Yayasan Tuaian Dunia serta akademis oleh Dirjen Bimas (Kristen) Protestan, Departemen Agama Republik Indonesia, dan diasuh oleh International Full Gospel Fellowsip (IFGF).</div><div><br></div><div>HITS mempunyai komitmen untuk mempersiapkan pemimpin-pemimpin yang unggul, terampil dan berdedikasi tinggi untuk memenuhi tantangan-tantangan masyarakat abad 21. Oleh sebab itu, HITS mengutamakan pengembangan karakter, kedisiplinan, dan kehidupan doa dan kasih para mahasiswanya sehingga menjadi gaya hidup dan dasar kepemimpinan. HITS menawarkan Program Studi Sarjana Teologi, Program Studi Pendidikan Agama Kristen, Program Studi Musik Gerejawi, serta Program Studi Pasca Sarjana dan Doctoral di bidang kepemimpinan dan transformasi. Setiap program studi telah terakreditasi oleh BAN PT.</div>', '//www.hits.ac.id', 4000000, 'logo-hits.webp', 'hits-1.webp', 'hits-2.webp', 'hits-3.webp', 'hits-4.webp', 'hits-5.webp', NULL, NULL, '2023-02-27', '2022-04-04 01:20:49', NULL, 1, 'hits', '2022-04-03 18:21:44', '2022-04-06 14:20:12', NULL),
(201, 'PORTFOLIO000201', 12, 285, 'u3726482', 'Hits2022', 1, 1, 'STMIK Harvest', 'STMIK Harvest adalah sebuah perguruan tinggi komputer yang didirikan oleh Yayasan STMIK Harvest, salah satu yayasan milik World Harvest, sebuah organisasi nirlaba internasional yang berkomitmen untuk memberi dampak pada dunia melalui pengembangan komunitas, pendidikan dan media.', '//www.stmikku.ac.id', 4000000, 'logo-stmik-harvest.webp', 'stmik-harvest-1.webp', 'stmik-harvest-2.webp', 'stmik-harvest-3.webp', 'stmik-harvest-4.webp', 'stmik-harvest-5.webp', NULL, NULL, '2023-05-13', '2022-05-13 00:02:03', NULL, 1, 'stmik-harvest', '2022-05-12 17:03:19', '2022-06-26 18:45:49', NULL),
